INSERT INTO `agenda` (`id_agenda`, `id_profile`, `id_categoria_agenda`, `titulo`, `resumen`, `contenido`) VALUES
(1, 1, 6, 'Técnico em Telecomunicações', 'Curso profissionalizante em que o aluno aprende a trabalhar com os mais modernos sistemas de telecomunicações, tais como transmissão de dados por meio de unidades de acesso.', '<p>&nbsp;<span style="color: rgb(85, 85, 85); font-family: Tahoma; ">Curso profissionalizante em que o aluno aprende a trabalhar com os mais modernos sistemas de telecomunica&ccedil;&otilde;es, tais como transmiss&atilde;o de dados por meio de unidades de acesso, tecnologia XDSL, fibras &oacute;pticas, wireless, telefonia e CATV. Tem como diferencial oferecer, durante o M&oacute;dulo 3, o conte&uacute;do do M&oacute;dulo I da Cisco/CCNA, habilitando o aluno (caso aprovado) a dar continuidade na forma&ccedil;&atilde;o Cisco. O participante ainda tem direito ao registro junto ao CREA, &oacute;rg&atilde;o que regulamenta a profiss&atilde;o.</span></p>'),
(2, 8, 1, 'Técnico em Informática para Internet', '', '<p>&nbsp;</p>\r\n<div>Formar t&eacute;cnicos de n&iacute;vel m&eacute;dio que desejem atuar com a internet, abrangendo as principais necessidades do profissional desta &aacute;rea, desde as linguagens mais comuns, gerenciamento de banco de dados, passando por desenvolvimento e gest&atilde;o de com&eacute;rcio eletr&ocirc;ni<strong>co e aspectos legais e me</strong>rcadol&oacute;gicos.</div>\r\n<div>&nbsp;</div>\r\n<div>O curso prepara o profissional para a realiza&ccedil;&atilde;o de atividades que v&atilde;o desde a edi&ccedil;&atilde;o de conte&uacute;do textual e imag&eacute;tico para websites at&eacute; realiza&ccedil;&otilde;es complexas de cria&ccedil;&atilde;o e produ&ccedil;&atilde;o de plataformas de com&eacute;rcio eletr&ocirc;nico, utilizando recursos sofisticados de linguagem orientada a objetos.</div>\r\n<div>&nbsp;</div>\r\n<div>O curso estimula ainda a atitude empreendedora e a promo&ccedil;&atilde;o de condi&ccedil;&otilde;es para que o aluno desenvolva um plano de neg&oacute;cios que tenha aplicabilidade e que poder&aacute; contribuir inclusive para a cria&ccedil;&atilde;o de sua pr&oacute;pria empresa, caso seja esse seu interesse.</div>\r\n<div>&nbsp;</div>\r\n<div>Diferenciais</div>\r\n<div>O curso integra as &aacute;reas de comunica&ccedil;&atilde;o, tecnologia e empreendendorismo, contribuindo para o desenvolvimento de um perfil profissional diferenciado e ainda mais valorizado no mercado de trabalho.</div>\r\n<div>(Carga hor&aacute;ria m&iacute;nima: 1.000)</div>\r\n<div>&nbsp;</div>');
