(9, 'Wellington', 'Araújo', '2', 'wellmiranda84@gmail.com', 'Teste de envio. 10:20 - 30/08/2012', '1'),
(10, 'Maria Aparecida de', 'Souza', '6', 'cida28@ig.com.br', 'Boa Noite,\r\n\r\nTerminei em 1995,o curso de Administração e gostaria de solicitar meu diploma.\r\nVocês podem informar quais os procedimentos devo tomar?\r\nMaria Aparecida de Souza\r\nRG:17463484\r\nCPF:03774499896', '1'),
(11, 'jennis', 'da silva', '9', 'jennis-dasilva@hotmail.com', 'Boa noite.\r\n\r\nEu sou aluna da faculdade Alfacastelo, e gostaria de saber se eu me transferisse para Fito se continuaria no mesmo semestre.\r\nEstou no 6º semestre de administração e já fiz as seguintes matérias:\r\nComunicação e expressão  80hrs\r\nFilosofia  40 hrs\r\nInformática  40 hrs\r\nIntrodução a economia  40 hrs\r\nInstituições do direito  40 hrs\r\nMatemática  80 hrs \r\nSociologia 40 hrs\r\nTécnicas de negociação 40 hrs\r\nAdministração contemporânea  80 hrs\r\nEstrutura Organizacional 40 hrs\r\nÉtica e responsabilidade social  40 hrs \r\nMétodos e técnicas de pesquisa  40 hrs\r\nMercado financeiro e de capitais  40 hrs\r\nPsicologia  40 hrs  \r\nTeoria microeconômica  40 hrs\r\nTeoria macroeconômica  40 hrs\r\nAdministração brasileira   40 hrs\r\nComputação aplicada  40 hrs\r\nContabilidade gerencial  40 hrs\r\nDireito comercial   80 hrs \r\nPesquisa operacional  40 hrs\r\nSistemática de recursos humanos  40 hrs\r\nTeoria das organizações  40 hrs\r\nTécnologia de sistemas de informações  40 hrs\r\nAdministração financeira  80 hrs\r\nContabilidade geral  40 hrs\r\nConsultoria empresarial  40 hrs\r\nDireito tributário  40 hrs\r\nEStrategias empresariais  40 hrs\r\nGestão do conhecimento  40 hrs\r\nMatemática financeira  80 hrs\r\nContabilidade intermediaria\r\nTga \r\nAdministração de suprimentos\r\nAdministração de Rh\r\nCriação de novas empresas\r\nInglês\r\n\r\nEstou no 6º semestre cursando:\r\nPlanejamento e controle de marketing\r\nAdministração de suprimentos\r\nPlanejamento, programação e controle da produção\r\nIntrodução ao marketing\r\nEstatística\r\nContabilidade de custos\r\nComercio exterior\r\nLogística e gerenciamento da cadeia de suprimentos\r\n \r\nGostaria de saber se eu começar  o ano que vem na Fito se iria para o 7º semestre, ou se voltaria algum semestre, pois vou terminar o 6º agora e ano q vem vou para o 7º.\r\n\r\nCaso não seja possível ingressar em 2013 a partir do 7º semestre, gostaria de saber se tem a possibilidade de abrir uma turma nova, pois tem aproximadamente 15 alunos com a mesma grade que eu querendo mudar de faculdade, mas começar o ano que vem no 7º semestre que é o semestre  que estamos.\r\nAguardo retorno....\r\n\r\n\r\nObrigado,\r\n\r\nJennis\r\n(11) 9 6137-4268', '1'),
(12, 'Robson', 'Muratian', '10', 'robson.muratian@uol.com.br', 'Bom dia\r\n\r\nNa nova pagina(SITE) onde esta as opções de Boletim, Boletos ????\r\n\r\nDesde já agradeço', '1'),
(13, 'ALICE', 'OLIVEIRA', '4', 'aarteira@hotmail.com', 'Gostei da nova apresentação do site. Muito obrigada por estarem melhorando a escola onde meus filhos estudam.\r\nAcredito que a comunicação por e-mail poderá agilizar a comunicação e estreitar as relações entre pais, coordenadores, professôres e funcionários em geral.\r\nEstou enviando este e-mail para testar se o serviço de e-mail está realmente funcionando. Para tanto, peço sua atenção em responder esta mensagem.\r\nUm ótimo dia a todos.\r\nM.Alice de Oliveira', '1'),
(14, 'Adriana', 'Zanoni', '6', 'adriana_zanoni@hotmail.com', 'Boa Tarde !!!\r\n\r\nMe formei em ADM em 2004 e até o momento não tenho meu diploma, já fui diversas vezes pessoalmente na secretaria e sempre me pedem 7 dias para retorno, porém já se passaram quase 8 anos e até agora estou sem meu diploma, tenho em mãos apenas o certificado de conclusão, podem me dar um retorno por gentileza.\r\n\r\nAguardo', '1'),
(15, 'William', 'Euclides', '6', 'william.euclidess@gmail.com', 'Boa tarde,\r\n\r\n    Em outubro teremos a semana da engenharia na FAC, vai ser divulgado no site?\r\n\r\n    Também em outubro meu grupo de TCC participará do 20ºSIICUSP e 14 ºSICT da FATEC será divulgado no site da FAC?\r\n\r\n   Tenho videos do último projeto da semana da engenharia poderia postar no site?\r\n\r\nhttp://www.usp.br/siicusp/\r\nhttp://sict.fatecsp.br/\r\n\r\nAtt. William E.', '1'),
(16, 'Mônica', 'Araujo de Assis', '6', '4040.monica@bradesco.com.br', 'Boa Tarde!\r\nPrezados, \r\n\r\nTenho interesse em ingressar o curso de ciências contábeis no ano que vem, no entanto, gostaria de maiores informações tais como: valor do curso e emenda.\r\n\r\nDesde ja obrigada. \r\n\r\nMônica', '1'),
(17, 'LILIAN', 'SILVA', '6', 'lillamarques@globo.com', 'Boa tarde! Gostaria de saber como são feitas as contratações de professores. Existe um email para cadastrar mue currículo? No aguardo de breve retorno. Grata.', '1'),
(18, 'VALDIR', 'GOMES DE OLIVEIRA', '6', 'vgol30@uol.com.br', 'Solicitei o meu diploma em fevereiro de 2011 e me deram um prazo de 18 meses. No mês passado fui retirar e tive a informação de que não ficou pronto. Estou concluindo meu curso de MBA e a instituição está solicitando o diploma. Para a matricula aceitaram o histórico, porém, para a conclusão do curso estão solicitando o diploma. Gostaria de saber o que posso fazer para conseguir esse diploma o mais urgente possível.\r\n\r\nAluno: Valdir Gomes de Oliveira\r\nCurso: Economia \r\nAno de Conclusão: 2003', '1'),
(19, 'Deborah', 'Fogaça Minicz', '7', 'deborahminicz@uol.com.br', 'Gostaria de inscrever meu filho para o concurso Amaral Vieira no dia 22/09/12 na categoria 8 anos. Já fiz um contato por telefone com a Sra. Valdilice de Carvalho. Aguardo retorno, pois estou informada que a inscrição vai até o dia 15/09.', '1'),
(20, 'Deborah', 'Fogaça Minicz', '7', 'deborahminicz@uol.com.br', 'Gostaria de inscrever meu filho para o concurso Amaral Vieira no dia 22/09/12 na categoria 8 anos. Já fiz um contato por telefone com a Sra. Valdilice de Carvalho. Aguardo retorno, pois estou informada que a inscrição vai até o dia 15/09.', '1'),
(21, 'Deborah', 'Minicz', '8', 'deborahminicz@uol.com.br', 'Gostaria de inscrever meu filho para o concurso Amaral Vieira no dia 22/09/12 na categoria 8 anos. Já fiz um contato por telefone com a Sra. Valdilice de Carvalho. Aguardo retorno, pois estou informada que a inscrição vai até o dia 15/09.', '1'),
(22, 'Olszowka', 'magdalena', '6', 'molszowka@hireright.com', 'Queria verificar diploma de nosso Candidate. Por favor, manda me um email, vou indicar os dados e autorizacao. Muito obrigada.\r\n\r\nMelhores cumprimentos\r\n\r\nMagdalena Olszowka\r\nBackground Screening Analyst\r\nHireRight\r\nGun Court | 70 Wapping Lane | London | E1W 2RD | United Kingdom \r\n+44 (0) 1273 760 741 Tel \r\n+44 (0) 1273 760 348 Fax\r\nmolszowka@hireright.com', '1'),
(23, 'Paula', 'Ferezin Martins', '9', 'academiamovefitness@gmail.com', 'Olá! Gostaria de propor uma parceria para oferecer descontos aos alunos e funcionários para a academia Move Fitness. Localizada no centro de Osasco, trabalhamos com musculação, aulas de ginástica, dança de salão e capoeira.\r\nCaso tenham interesse favor entrar em contato pelo e-mail cadastrado ou pelo telefone 4554-6813. Obrigada!', '1'),
(24, 'Paula', 'Ferezin Martins', '5', 'academiamovefitness@gmail.com', 'Olá! Gostaria de propor uma parceria para oferecer descontos aos alunos e funcionários para a academia Move Fitness. Localizada no centro de Osasco, trabalhamos com musculação, aulas de ginástica, dança de salão e capoeira.\r\nCaso tenham interesse favor entrar em contato pelo e-mail cadastrado ou pelo telefone 4554-6813. Obrigada!', '1'),
(25, 'José', 'Gomes', '5', 'j2lg_nm@yahoo.com.br', 'Boa noite,\r\nEu tenho um filho de 6 anos de idade, e gostaria de saber como faço para que ele pudesse estudar na fito.\r\nGostaria de saber tambem se possivel o preço da mensalidade.\r\n\r\nGrato,\r\n\r\nJosé Gomes', '1'),
(26, 'Sérgio Ricardo', 'Nascimento', '4', 'srn_1974@yahoo.com.br', 'Prezados,\r\nBom dia!\r\nTenho um filho com 15 anos completos neste ano e, atualmente ele cursa o primeiro ano do Ensino Médio regular. Gostaria que além do médio ele fizesse o técnico em eletrônica junto. Diante disto, gostaria de obter as seguintes informações:\r\n1) É possível ele iniciar o 2o do Ensino Médico técnico em eletrônica, mesmo que tenha que fazer uma adaptação (tempo extra)?\r\n2) Como é o acesso à escola? Há vestibulinho? Vocês aceitam transferência de outra escola?\r\n3) Qual o custo do Ensino Médio (+ adpatação se houver)?\r\n4) Qual o período para inscrição/matrícula?\r\n\r\nDesde já, muito obrigado pela atenção.\r\n\r\nSérgio Ricardo do Nascimento', '1'),
(27, 'Paula', 'Fernandes da Silva', '6', 'paula.fernandes.ssilva@hotmail.com', 'Bom dia. \r\nEstou interessada em fazer o curso de música na unidade. Gostaria de saber os preços, como funciona a forma de pagamento, a duração do curso, etc.\r\nSe possível, me mandem todas as informações por email. \r\nObrigada\r\nPaula Fernandes.', '1'),
(28, 'Simone', 'Almeida Nascimento', '1', 'simonealmeidan@hotmail.com', 'Docente de Geografia com Licenciatura USP.\r\nTEL 11 35332983\r\n      986072823', '1'),
(29, 'Letícia', 'Pacheco', '6', 'leticinha_ap@hotmail.com', 'Olá, me interessei pelo curso de música. Gostaria de saber se tem bacharelado em violão popular e licenciatura e o que vocês pedem no processo seletivo e se a faculdade é gratuita. Grata.', '1'),
(30, 'Robson', 'Muratian', '9', 'robson.muratian@uol.com.br', 'Bom dia\r\n\r\nNa nova pagina(SITE) como eu entro para verificar - NOTAS, IMPRESSOA DE BOLETOS  e ETC.......\r\n\r\nDesde já agradeço atenção', '1'),
(31, 'André', 'Heryson', '6', 'andreheryson@gmail.com', 'Bom dia\r\nMe chamo André Heryson, sou músico formado pela FAAM (FMU) com especialização em Canto Lírico  e  regência coral gostaria de saber qual o procedimento para enviar um currículo para o Conservatório Musical visando a possibilidade de se um professor colaborador.\r\nAtenciosamente \r\nAndré Heryson, barítono\r\n(11) 9763 – 0851', '1'),
(32, 'Safira', 'de Lucca', '9', 'safi_861@hotmail.com', 'Olá,\r\n\r\nEu gostaria de saber se vocês organizarão\r\nvestibular no meio de 2013.\r\nE também não encontrei no site, mas\r\nmeu interesse é fazer faculdade de canto lírico,\r\noferecem esse curso?\r\n\r\nGrata,\r\nSafira', '1'),
(33, 'ANDRÉ LUÍS', 'SIMADON BERTONI', '7', 'andre.bertoni@ig.com.br', 'Sou funcionário aposentado da Prefeitura do Município de Osasco, gostaria de saber se há desconto para aposentado para o curso de Piano e Teclado, além disto, também saber outras informações: quanto custa o curso, duração, horário e inicio, desde já aproveito para elevar os meus votos de estima e distinta consideração. Obrigado!', '1'),
