INSERT INTO `curso` (`id_curso`, `id_profile`, `id_categoria_curso`, `id_subcategoria_curso`, `titulo`, `resumen`, `contenido`) VALUES
(12, 3, 5, 12, 'Ensino Fundamental', 'Na FITO, as crianças iniciam o caminho do conhecimento desenvolvendo habilidades por meio de múltiplas linguagens. Além da base nacional comum, as crianças têm aulas de música, informática, artes, inglês e educação física.', '<p>Na FITO, as crian&ccedil;as iniciam o caminho do conhecimento desenvolvendo habilidades por meio de m&uacute;ltiplas linguagens. Al&eacute;m da base nacional comum, as crian&ccedil;as t&ecirc;m aulas de m&uacute;sica, inform&aacute;tica, artes, ingl&ecirc;s e educa&ccedil;&atilde;o f&iacute;sica. S&atilde;o seis aulas di&aacute;rias e equipe t&eacute;cnica comprometida com a forma&ccedil;&atilde;o integral. A &ecirc;nfase nas s&eacute;ries iniciais &eacute; a forma&ccedil;&atilde;o de conceitos. Para tanto, a FITO valoriza o uso de material concreto, e parceria com o apostilado do SER, desenvolvido pela Editora Abril, e uma educa&ccedil;&atilde;o ambiental, bem como estudos do meio, que integram as nossas atividades regulares.<br />\r\n<br />\r\nO curr&iacute;culo do Ensino Fundamental &eacute; constitu&iacute;do por uma Base Nacional Comum e uma Parte Diversificada, e tem como objetivo a forma&ccedil;&atilde;o b&aacute;sica do aluno, mediante: <br />\r\n&bull; desenvolvimento da capacidade de aprender, tendo como meios b&aacute;sicos o pleno dom&iacute;nio da leitura, da escrita e do c&aacute;lculo; <br />\r\n&bull; A compreens&atilde;o do ambiente natural e social, do sistema pol&iacute;tico, da tecnologia, das artes e dos valores em que se fundamenta a sociedade; <br />\r\n&bull; desenvolvimento da capacidade de aprendizagem, tendo em vista a aquisi&ccedil;&atilde;o de conhecimentos e habilidades e a forma&ccedil;&atilde;o de atitudes e valores; <br />\r\n&bull; fortalecimento dos v&iacute;nculos de fam&iacute;lia, dos la&ccedil;os de solidariedade humana e de toler&acirc;ncia rec&iacute;proca em que se assenta a vida social. <br />\r\n<br />\r\nO desenvolvimento do curr&iacute;culo no Ensino Fundamental ser&aacute; integrado, visando estabelecer a rela&ccedil;&atilde;o entre a Vida Cidad&atilde;, atrav&eacute;s de seus aspectos: sa&uacute;de, sexualidade, vida familiar e social, meio ambiente, trabalho, ci&ecirc;ncia e tecnologia, cultura e linguagens, e as &Aacute;reas de Conhecimento: L&iacute;ngua Portuguesa, Matem&aacute;tica, Ci&ecirc;ncias, Geografia, Hist&oacute;ria, L&iacute;ngua Estrangeira, Educa&ccedil;&atilde;o Art&iacute;stica, Educa&ccedil;&atilde;o F&iacute;sica, M&uacute;sica e Inform&aacute;tica. Os alunos, ao aprenderem os conhecimentos e valores da Base Nacional Comum e da Parte Diversificada, estar&atilde;o, tamb&eacute;m, constituindo sua identidade como cidad&atilde;os, capazes de serem protagonistas de a&ccedil;&otilde;es respons&aacute;veis, solid&aacute;rias e aut&ocirc;nomas em rela&ccedil;&atilde;o a si pr&oacute;prios, &agrave;s suas fam&iacute;lias, e &agrave;s comunidades. <br />\r\n<br />\r\n<strong>A FITO oferece: </strong><br />\r\n&bull; Recursos Audiovisuais <br />\r\n&bull; Salas-ambiente de M&uacute;sica e Artes<br />\r\n&bull; Gin&aacute;sio de Esportes <br />\r\n&bull; Teatros Greco-Romanos para grandes eventos <br />\r\n&bull; Laborat&oacute;rios de Biologia <br />\r\n&bull; Laborat&oacute;rios de Inform&aacute;tica com livre acesso &agrave; Internet <br />\r\n&bull; Biblioteca com acervo de livros e revistas especializadas, al&eacute;m da Internet.</p>\r\n<p><strong>Hor&aacute;rios:</strong></p>\r\n<p><strong>Unidade 1:</strong></p>\r\n<p>Vespertino, das 13h &agrave;s 18h15 para alunos de primeiro a nono anos.</p>\r\n<p><strong>Unidade 2</strong>:<br />\r\nMatutino, das 7h &agrave;s 12h15 para alunos de primeiro a nono anos<br />\r\nVespertino, das 13h &agrave;s 18h15 para alunos de primeiro a nono anos.</p>'),
(13, 3, 3, 13, 'Ensino Médio Básico', 'No Ensino Médio, o aluno é preparado para ingressar nas melhores universidades, por meio de suporte educacional altamente qualificado, desenvolvido em três séries anuais, no período da manhã.', '<p>No Ensino M&eacute;dio, o aluno &eacute; preparado para ingressar nas melhores universidades, por meio de suporte educacional altamente qualificado, desenvolvido em tr&ecirc;s s&eacute;ries anuais, no per&iacute;odo da manh&atilde;, no hor&aacute;rio das 7h &agrave;s 12h15. Prepara o aluno para o exerc&iacute;cio da cidadania, para o desenvolvimento pessoal, para o acesso &agrave;s atividades e para o prosseguimento de estudos na faculdade.&nbsp; <br />\r\n<br />\r\nAs finalidades do Ensino M&eacute;dio da FITO: <br />\r\n&bull; A consolida&ccedil;&atilde;o e o aprofundamento dos conhecimentos adquiridos no ensino fundamental, possibilitando o prosseguimento de estudos. <br />\r\n&bull; A prepara&ccedil;&atilde;o b&aacute;sica para o trabalho e a cidadania do educando, para continuar aprendendo, de modo a ser capaz de se adaptar com flexibilidade a novas condi&ccedil;&otilde;es de ocupa&ccedil;&atilde;o ou aperfei&ccedil;oamento posterior. <br />\r\n&bull; O aprimoramento do educando como pessoa humana, incluindo a forma&ccedil;&atilde;o &eacute;tica e o desenvolvimento da autonomia intelectual e do pensamento cr&iacute;tico. <br />\r\n&bull; A compreens&atilde;o dos fundamentos cient&iacute;fico-tecnol&oacute;gicos &eacute; promovida por meio da rela&ccedil;&atilde;o teoria e pr&aacute;tica no ensino de cada disciplina. <br />\r\n<br />\r\n<strong>A FITO oferece:</strong> <br />\r\n&bull; Recursos audiovisuais.<br />\r\n&bull; Salas-ambiente de M&uacute;sica e Artes. <br />\r\n&bull; Gin&aacute;sio de esporte.<br />\r\n&bull; Teatro greco-romano para grandes eventos.<br />\r\n&bull; Laborat&oacute;rios de Biologia, F&iacute;sica e Qu&iacute;mica. <br />\r\n&bull; Laborat&oacute;rios de Inform&aacute;tica com livre acesso &agrave; Internet.<br />\r\n&bull; Biblioteca com acervo de livros e revistas especializadas, al&eacute;m da Internet.</p>'),
(14, 3, 1, 10, 'Técnico em Construção Civil', 'O técnico em Construção Civil pode atuar em projeto, construção, fiscalização de obras, perícia, planejamento e manutenção, nas seguintes áreas e aplicações de materiais, estrutura, hidráulica, transporte, e mais!', '<p>O curso t&eacute;cnico em Constru&ccedil;&atilde;o Civil &eacute; votado &agrave; forma&ccedil;&atilde;o de profissionais t&eacute;cnicos que atuam na &aacute;rea. Para tanto, a FITO disp&otilde;e de modernos laborat&oacute;rios de inform&aacute;tica, de edifica&ccedil;&otilde;es, bibliotecas com acervo de livros e revistas especializadas, gin&aacute;sio de esportes, teatros greco-romanos para grandes eventos, al&eacute;m da Internet colocada &agrave; disposi&ccedil;&atilde;o de seus alunos. <br />\r\nO t&eacute;cnico em Constru&ccedil;&atilde;o Civil pode atuar em projeto, constru&ccedil;&atilde;o, fiscaliza&ccedil;&atilde;o de obras, per&iacute;cia, planejamento e manuten&ccedil;&atilde;o, nas seguintes &aacute;reas e aplica&ccedil;&otilde;es respectivas:<br />\r\n- materiais: ind&uacute;strias de concreto e de pr&eacute;-moldados;<br />\r\n- estrutura: edif&iacute;cios residenciais, industriais, comerciais, pontes, barragens, etc.;<br />\r\n- hidr&aacute;ulica e saneamento: sistema de tratamento e de distribui&ccedil;&atilde;o de &aacute;gua, sistema de cadocado em geral;<br />\r\n- transporte e geotecnia: estradas, aeroportos, portos, sistemas vi&aacute;rios, obras de terra, funda&ccedil;&otilde;es;<br />\r\n- instala&ccedil;&otilde;es el&eacute;tricas de pequeno porte;<br />\r\n- administra&ccedil;&atilde;o e ger&ecirc;ncia, inform&aacute;tica e pequenos projetos arquitet&ocirc;nicos. <br />\r\n<br />\r\nO t&eacute;cnico &eacute; habilitado para trabalhar em: <br />\r\n&bull; Escrit&oacute;rios de constru&ccedil;&atilde;o civil; <br />\r\n&bull; Ind&uacute;strias; <br />\r\n&bull; Empresas construtoras; <br />\r\n&bull; Servi&ccedil;os p&uacute;blicos; <br />\r\n&bull; Institui&ccedil;&otilde;es espec&iacute;ficas ligadas a engenharia. <br />\r\n&nbsp; <br />\r\n<strong>Dura&ccedil;&atilde;o:</strong> 4 anos <br />\r\n<strong>Hor&aacute;rios: </strong>1&deg; e 2&deg; anos: das 07h &agrave;s 12h15 e das 19h15 &agrave;s 23h15<strong><br />\r\nHor&aacute;rios: </strong>3&deg; e 4&deg; anos: das 19h15 &agrave;s 23h15.<br />\r\n&nbsp;</p>'),
(15, 3, 1, 9, 'Técnico em Eletrônica ', 'Curso de tradição da FITO, tido por excelência na  formação de Técnicos em Eletrônica para atuação em empresas eletro eletrônicas  de âmbito nacional e internacional.', '<p>Curso de tradi&ccedil;&atilde;o da FITO, tido por excel&ecirc;ncia na&nbsp; forma&ccedil;&atilde;o de T&eacute;cnicos em Eletr&ocirc;nica para atua&ccedil;&atilde;o em empresas eletro eletr&ocirc;nicas&nbsp; de &acirc;mbito nacional e internacional.<br />\r\nAl&eacute;m da forma&ccedil;&atilde;o b&aacute;sica, comum a todas as &aacute;reas, os fundamentos cient&iacute;ficos e tecnol&oacute;gicos complementam o curso propiciando as condi&ccedil;&otilde;es necess&aacute;rias ao profissional para engajar-se em v&aacute;rios segmentos da eletr&ocirc;nica.<br />\r\nO t&eacute;cnico em Eletr&ocirc;nica elabora e acompanha as diferentes fases de montagem e produ&ccedil;&atilde;o, prestando assist&ecirc;ncia t&eacute;cnica, tanto na instala&ccedil;&atilde;o quanto nos reparos de produtos utilizados em eletr&ocirc;nica digital, pot&ecirc;ncia, industrial e sistemas de comunica&ccedil;&otilde;es, podendo trabalhar em setores, como pesquisa, assessoria, projetos, administra&ccedil;&atilde;o, manuten&ccedil;&atilde;o, compras, vendas, pesquisa de mercado, controle de qualidade e elabora&ccedil;&atilde;o de or&ccedil;amentos.&nbsp; Al&eacute;m disso, esse t&eacute;cnico tamb&eacute;m pode atuar na &aacute;rea da medicina, em montagens e instala&ccedil;&otilde;es, como tamb&eacute;m na manuten&ccedil;&atilde;o de equipamentos eletr&ocirc;nicos, em empresas, tanto p&uacute;blicas quanto privadas, ind&uacute;strias, bancos e outras que v&ecirc;m incrementando os seus equipamentos de maneira a acompanhar a evolu&ccedil;&atilde;o e o r&aacute;pido avan&ccedil;o da automa&ccedil;&atilde;o, como os incrementos da produ&ccedil;&atilde;o e das vendas nos setores eletro eletr&ocirc;nicos e de comunica&ccedil;&otilde;es digitais.<br />\r\n&nbsp;<br />\r\n<strong>Dura&ccedil;&atilde;o:</strong> 4 anos, com est&aacute;gio supervisionado a partir do 3&deg; ano.<br />\r\n<strong>Hor&aacute;rios:</strong> 1&deg; e 2&deg; anos: das 07h &agrave;s 12h15 e das 19h15 &agrave;s 23h15<br />\r\n<strong>Hor&aacute;rios:</strong> 3&deg; e 4&deg; anos: das 19h15 &agrave;s 23h15.<br />\r\n&nbsp;</p>'),
(16, 3, 1, 9, 'Técnico em Eletrônica - Mecatrônica', 'O Técnico em Mecatrônica usa muito a criatividade, projetando e imaginando novas técnicas e produtos. Prima pela meticulosidade e exatidão em suas tarefas, atuando nas áreas de robótica, computação, controle e sistemas automatizados industriais.', '<p>No curso T&eacute;cnico em Mecatr&ocirc;nica, o aluno aplica um conjunto de conhecimentos cient&iacute;ficos e tecnol&oacute;gicos, por meio de situa&ccedil;&otilde;es que preparam o futuro profissional que necessita o mercado de trabalho para a moderniza&ccedil;&atilde;o industrial.<br />\r\nO T&eacute;cnico em Mecatr&ocirc;nica usa muito a criatividade, projetando e imaginando novas t&eacute;cnicas e produtos. Prima pela meticulosidade e exatid&atilde;o em suas tarefas, atuando nas &aacute;reas de rob&oacute;tica, computa&ccedil;&atilde;o, controle e sistemas automatizados industriais. Supervisiona os aspectos de fabrica&ccedil;&atilde;o, montagem e instala&ccedil;&atilde;o para assegurar a observ&acirc;ncia das especifica&ccedil;&otilde;es e padr&otilde;es de qualidade e seguran&ccedil;a.<br />\r\n<br />\r\nCampos de Aplica&ccedil;&atilde;o Profissional:<br />\r\n&bull;&nbsp;&nbsp;&nbsp; Atua no desenvolvimento tecnol&oacute;gico, econ&ocirc;mico e social de diversos campos. <br />\r\n&bull;&nbsp;&nbsp;&nbsp; Atua no controle e processo dos sistemas eletropneum&aacute;ticos, eletrohidr&aacute;ulicos e eletromec&acirc;nicos da ind&uacute;stria, seja ela t&ecirc;xtil, metal&uacute;rgica, automobil&iacute;stica, agropecu&aacute;ria, aeron&aacute;utica, naval e outras. <br />\r\n&bull;&nbsp;&nbsp;&nbsp; Executa a programa&ccedil;&atilde;o de controles para integrar rob&ocirc;s &agrave;s m&aacute;quinas de comando num&eacute;rico computadorizados, utilizados em trabalhos insalubres, locais t&oacute;xicos e at&eacute; mesmo na pesquisa de outros planetas. <br />\r\n&bull;&nbsp;&nbsp;&nbsp; Atua em nosso cotidiano, nos caixas eletr&ocirc;nicos, nas esteiras de mercado, escadas rolantes, elevadores das lojas, responsabilizando-se pela manuten&ccedil;&atilde;o desses equipamentos, garantindo nosso conforto e seguran&ccedil;a. <br />\r\n<br />\r\n<strong>Dura&ccedil;&atilde;o:</strong> 4 anos, com est&aacute;gio supervisionado a partir do 3&deg; ano.<br />\r\n<strong>Hor&aacute;rios:</strong> 1&deg; e 2&deg; anos: das 07h &agrave;s 12h15 e das 19h15 &agrave;s 23h15<br />\r\n<strong>Hor&aacute;rios:</strong> 3&deg; e 4&deg; anos: das 19h15 &agrave;s 23h15.</p>'),
(20, 3, 1, 11, 'Técnico em Administração', 'O Curso Técnico em Administração é voltado para atender as necessidades de empresas privadas e públicas.', '<p>O Curso T&eacute;cnico em Administra&ccedil;&atilde;o &eacute; voltado para atender as necessidades de empresas privadas e p&uacute;blicas.<br />\r\nS&atilde;o atribui&ccedil;&otilde;es do T&eacute;cnico em Administra&ccedil;&atilde;o:<br />\r\n&bull; Atender &agrave;s necessidades atuais de empresas nas &aacute;reas administrativa, comercial, log&iacute;stica, financeira, marketing, recursos humanos, gest&atilde;o de qualidade e outras; <br />\r\n&bull; Administrar sua pr&oacute;pria empresa e atuar em assessoria e consultoria empresarial.<br />\r\n<strong><br />\r\n&Aacute;reas de atua&ccedil;&atilde;o profissional:</strong><br />\r\n&bull; Entidades n&atilde;o governamentais; <br />\r\n&bull; Empresas p&uacute;blicas ou privadas; <br />\r\n&bull; Consultorias ou &oacute;rg&atilde;os p&uacute;blicos; <br />\r\n&bull; Bancos ou financeiras;<br />\r\n&bull; Escolas e hospitais; <br />\r\n&bull; Gerenciamento de sua pr&oacute;pria empresa.<br />\r\n<br />\r\n<strong>Dura&ccedil;&atilde;o do curso:</strong> 03 anos<br />\r\n<br />\r\n<strong>Hor&aacute;rio: </strong><br />\r\n1&ordm; ano: de segunda a sexta feira, das 7h &agrave;s 12h15; <br />\r\n2&ordm;, 3&ordm; anos: das 19h15 &agrave;s 23h15min e aos s&aacute;bados das 8h &agrave;s 12h40.</p>'),
(21, 3, 4, 11, 'Administração', 'O curso de Administração visa à formação de um profissional com visão sistêmica do seu campo de atuação, por meio de conhecimento eclético, permitindo sua rápida adaptação às condições impostas pelo mercado. ', '<p>O curso de Administra&ccedil;&atilde;o visa &agrave; forma&ccedil;&atilde;o de um profissional com vis&atilde;o sist&ecirc;mica do seu campo de atua&ccedil;&atilde;o, por meio de conhecimento ecl&eacute;tico, permitindo sua r&aacute;pida adapta&ccedil;&atilde;o &agrave;s condi&ccedil;&otilde;es impostas pelo mercado. O curso desenvolve a capacidade empreendedora do aluno, tornando-o capaz de vislumbrar novas oportunidades ou nichos de neg&oacute;cios. Dessa forma, sua forma&ccedil;&atilde;o &eacute; bem ampla. O futuro profissional desenvolve uma vis&atilde;o de mundo, n&atilde;o se atendo somente aos resultados imediatos, mas, tamb&eacute;m, com os impactos de suas a&ccedil;&otilde;es nas demais &aacute;reas da empresa. H&aacute; que se ressaltar que o curso de Administra&ccedil;&atilde;o da FAC-FITO tem se destacado na regi&atilde;o pela boa forma&ccedil;&atilde;o de seus alunos. Muitos alunos formados pela FAC-FITO ocupam posi&ccedil;&atilde;o de destaque em empresas de m&eacute;dio e grande porte. No ENADE de 2006, obtivemos nota 3 e conceito IDD 5, um dos melhores desempenhos de S&atilde;o Paulo. </p>\r\n<p><br />\r\n<strong>Mercado de Trabalho </strong><br />\r\nO mercado de trabalho para o administrador &eacute; bastante abrangente constituindo-se de empresas de pequeno, m&eacute;dio e grande porte. O administrador est&aacute; presente em qualquer ramo de atividade por estar vinculado a insumos b&aacute;sicos para o funcionamento das atividades empresariais envolvendo planejamento, organiza&ccedil;&atilde;o, dire&ccedil;&atilde;o e controle. O administrador pode, tamb&eacute;m, atuar como empreendedor de seu pr&oacute;prio neg&oacute;cio. Podemos destacar as seguintes &aacute;reas de atua&ccedil;&atilde;o: Administra&ccedil;&atilde;o Geral; Produ&ccedil;&atilde;o; Vendas; Finan&ccedil;as; Marketing; Recursos Humanos; Organiza&ccedil;&atilde;o; Sistemas e M&eacute;todos; Planejamento Estrat&eacute;gico e Log&iacute;stico.</p>\r\n<p><br />\r\n<strong>Dura&ccedil;&atilde;o: </strong>08 semestres<br />\r\n&nbsp;</p>'),
(23, 3, 4, 14, 'Ciências Contábeis', 'Forma o profissional contador, assegura ao formando registro profissional no CRC. A formação é generalista permitindo atuação no mercado, podendo prestar serviços para empresas privadas, públicas e de economia mista.', '<p>O Curso de Ci&ecirc;ncias Cont&aacute;beis forma o profissional contador, profiss&atilde;o regulamentada pelo Decreto n&ordm;. 9.295/46 que assegura ao formando registro profissional no Conselho Regional de Contabilidade - CRC. A forma&ccedil;&atilde;o &eacute; generalista permitindo, assim, que o profissional formado tenha ampla atua&ccedil;&atilde;o no mercado, podendo prestar servi&ccedil;os para empresas privadas, p&uacute;blicas e de economia mista. O curso obteve conceito 3 e IDD3 no ENADE de 2006. <br />\r\n<br />\r\n<strong>Mercado de Trabalho </strong><br />\r\nA profiss&atilde;o vive momento &aacute;ureo. Vale lembrar que onde houver uma empresa, de pequeno, m&eacute;dio ou de grande porte, sempre existir&aacute; a figura essencial do contador. O profissional pode atuar como aut&ocirc;nomo ou empregado nas seguintes &aacute;reas ou modalidades: Perito Cont&aacute;bil - atribui&ccedil;&atilde;o exclusiva do contador: fazer per&iacute;cias judiciais ou extrajudiciais; Auditor - executa auditorias sobre pe&ccedil;as cont&aacute;beis; Contador - atua como respons&aacute;vel t&eacute;cnico da contabilidade da empresa; &quot;controller&quot;; gestor empresarial (elaborar e analisar relat&oacute;rios gerenciais de custos e or&ccedil;amentos, entre outros).<br />\r\n<strong><br />\r\nDura&ccedil;&atilde;o:</strong> 08 semestres</p>'),
(24, 3, 4, 16, 'Ciências Econômicas', 'Permite ao aluno desenvolver diversas atividades nas áreas relacionadas com a economia, empresas e sociedade, tais como exportação, importação, bolsa de valores, bolsa de mercadorias, atividades comerciais, agrícolas e industriais, entre outras.', '<p>O curso permite ao aluno desenvolver diversas atividades nas &aacute;reas relacionadas com a economia, empresas e sociedade, tais como exporta&ccedil;&atilde;o, importa&ccedil;&atilde;o, bolsa de valores, bolsa de mercadorias, atividades comerciais, agr&iacute;colas e industriais, trabalho em bancos, companhias de cr&eacute;dito e financiamento, entre outras. Dentro de uma empresa, o economista &eacute; capaz de verificar e analisar o terreno econ&ocirc;mico na qual ela se encontra e indicar o caminho que deve percorrer para se manter e se desenvolver no mercado atual, al&eacute;m de ser um profissional fundamental num mundo globalizado, pois disp&otilde;e de ferramentas e conhecimentos no sentido de alavancar a participa&ccedil;&atilde;o da empresa no mercado interno e externo. O Curso de Economia obteve a melhor classifica&ccedil;&atilde;o no ENADE entre as demais faculdades que ministram o mesmo curso na regi&atilde;o.<br />\r\n<strong><br />\r\nMercado de Trabalho</strong><br />\r\nO economista tem amplo leque de oportunidades no mercado de trabalho, que vai desde a doc&ecirc;ncia at&eacute; atua&ccedil;&atilde;o em diversos tipos de empresas. Atualmente, h&aacute; uma grande oferta de vagas, pois o economista possui uma forma&ccedil;&atilde;o abrangente do mercado. Assim, a cria&ccedil;&atilde;o, desenvolvimento e manuten&ccedil;&atilde;o das empresas pequenas, m&eacute;dias e de grande porte no mercado passam, necessariamente, pela contribui&ccedil;&atilde;o do economista. Tal profissional &eacute; requerido para atuar nos escal&otilde;es mais altos das empresas, inclusive multinacionais, como presidentes, diretores, gerentes e executivos de uma forma geral. Dentro desta concep&ccedil;&atilde;o, &eacute; um dos profissionais que tem remunera&ccedil;&atilde;o m&eacute;dia maior do que a maioria dos profissionais de n&iacute;vel superior. Mesmo quando estudantes, os est&aacute;gios nesta &aacute;rea, tamb&eacute;m, s&atilde;o remunerados acima da m&eacute;dia do mercado.<br />\r\n<br />\r\n&nbsp;<br />\r\n<strong>Dura&ccedil;&atilde;o:</strong> 08 semestres</p>'),
(25, 3, 4, 17, 'Engenharia Elétrica', 'Possibilita ao aluno atuar em diversas áreas: projetos de sistemas eletrônicos, desenvolvimento de novos equipamentos, automação e controle de processos, projeto e execução de instalações elétricas ou de telecomunicações.', '<p>O curso de Engenharia El&eacute;trica possibilita ao aluno atuar em diversas &aacute;reas: projetos de sistemas eletr&ocirc;nicos, desenvolvimento de novos equipamentos, automa&ccedil;&atilde;o e controle de processos, projeto e execu&ccedil;&atilde;o de instala&ccedil;&otilde;es el&eacute;tricas ou de telecomunica&ccedil;&otilde;es. As disciplinas oferecidas no curso abrangem todas as &aacute;reas de conhecimento da engenharia el&eacute;trica, o que permite ao aluno se desenvolver na &aacute;rea em que possui maior afinidade. O curso de Engenharia El&eacute;trica da FAC-FITO al&eacute;m de ser o melhor da regi&atilde;o, &eacute; o que apresenta as menores mensalidades.<br />\r\n<br />\r\n<strong>Mercado de Trabalho </strong><br />\r\nO mercado de trabalho para o engenheiro el&eacute;trico &eacute; bastante abrangente constituindo-se de ind&uacute;strias dos diversos ramos de atividade, entre elas: de energia, de telecomunica&ccedil;&otilde;es, de transportes, de servi&ccedil;os, sider&uacute;rgicas, mineradoras e eletroeletr&ocirc;nicas. O engenheiro el&eacute;trico est&aacute; presente em qualquer ramo de atividade por estar vinculado a insumos b&aacute;sicos para o funcionamento das diversas atividades fabris e de servi&ccedil;os que s&atilde;o a energia el&eacute;trica e as telecomunica&ccedil;&otilde;es. Por essa raz&atilde;o, &eacute; uma das profiss&otilde;es que possui uma das maiores remunera&ccedil;&otilde;es no mercado de trabalho.<br />\r\n<strong><br />\r\nDura&ccedil;&atilde;o:</strong> 10 semestres<br />\r\n&nbsp;</p>'),
(26, 3, 4, 18, 'Música', 'A FAC-FITO oferece as modalidades de Bacharelado (Graduação em Instrumento) e de Licenciatura (Educação Musical).', '<p>A FAC-FITO oferece as modalidades de Bacharelado (Gradua&ccedil;&atilde;o em Instrumento) e de Licenciatura (Educa&ccedil;&atilde;o Musical). Na modalidade Bacharelado s&atilde;o oferecidos os seguintes instrumentos: Piano; Contrabaixo; Clarinete; Viol&atilde;o; Saxofone; Percuss&atilde;o; Canto; Trompete; Bateria; Guitarra; Trombone. O bacharel em instrumento est&aacute; apto a ler e executar com perfei&ccedil;&atilde;o as mais variadas obras nos mais variados estilos, podendo atuar como instrumentista solista ou acompanhador, nas mais diversas forma&ccedil;&otilde;es instrumentais e g&ecirc;neros musicais encontrados no mercado de trabalho. Nossos cursos visam &agrave; forma&ccedil;&atilde;o de m&uacute;sicos completos, com base te&oacute;rica s&oacute;lida, conhecimentos de hist&oacute;ria da m&uacute;sica geral e brasileira, aprofundamentos pr&aacute;ticos em harmonia tradicional e funcional, contraponto, fuga, est&eacute;tica, inform&aacute;tica, pr&aacute;tica de conjunto, arranjo, princ&iacute;pios de reg&ecirc;ncia e composi&ccedil;&atilde;o. Conceito 3 no ENADE 2006.<br />\r\n<br />\r\n<strong>Mercado de Trabalho </strong><br />\r\nO profissional de m&uacute;sica pode atuar em bandas, shows, grava&ccedil;&otilde;es, produ&ccedil;&otilde;es musicais e orquestras, entre outros, bem como educador musical em conservat&oacute;rios, escolas, etc.<br />\r\n<br />\r\n<strong>Dura&ccedil;&atilde;o: </strong>06 semestres<br />\r\n&nbsp;</p>'),
(27, 3, 4, 19, 'Pedagogia', 'O aluno, além de dominar os diversos conteúdos e conhecimentos pedagógicos, é inserido nas novas linguagens e tecnologias que possibilitam o aperfeiçoamento da prática pedagógica e o gerenciamento de seu desenvolvimento profissional. ', '<p>O curso objetiva articular o trabalho pedag&oacute;gico com as transforma&ccedil;&otilde;es sociais, orientado pelos valores est&eacute;ticos, pol&iacute;ticos e &eacute;ticos inspiradores da sociedade democr&aacute;tica. O aluno, al&eacute;m de dominar os diversos conte&uacute;dos e conhecimentos pedag&oacute;gicos, &eacute; inserido nas novas linguagens e tecnologias que possibilitam o aperfei&ccedil;oamento da pr&aacute;tica pedag&oacute;gica e o gerenciamento de seu desenvolvimento profissional. Por essa raz&atilde;o, o curso se apoia numa consistente forma&ccedil;&atilde;o te&oacute;rica, pr&aacute;tica e interdisciplinar, a qual exige a familiariza&ccedil;&atilde;o com o exerc&iacute;cio da doc&ecirc;ncia e da gest&atilde;o pedag&oacute;gica, a participa&ccedil;&atilde;o em pesquisas educacionais e a realiza&ccedil;&atilde;o de trabalhos que permitam ao graduando articular ideias e experi&ecirc;ncias.<br />\r\n<strong><br />\r\nMercado de Trabalho </strong><br />\r\nO aluno do curso de Pedagogia poder&aacute; trabalhar como gestor e/ou docente nos seguintes segmentos: creches p&uacute;blicas e privadas (0 a 3 anos), pr&eacute;-escolas p&uacute;blicas e privadas (3 a 5 anos), nas s&eacute;ries iniciais do Ensino Fundamental de escolas p&uacute;blicas ou privadas (5 a 8 anos), empresas, institui&ccedil;&otilde;es e organiza&ccedil;&otilde;es que mantenham creches destinadas a crian&ccedil;as de 0 a 3 anos, e programas destinados a crian&ccedil;as de 4 a 5 anos ou a crian&ccedil;as de 6 a 10 anos. Como gestor e/ou professor em servi&ccedil;os de apoio em organiza&ccedil;&otilde;es escolares, comunit&aacute;rias, assistenciais, empresariais e organiza&ccedil;&otilde;es n&atilde;o governamentais, como gestor e/ou profissional em servi&ccedil;os de apoio em cursos de educa&ccedil;&atilde;o profissional, em cursos de Ensino M&eacute;dio, na modalidade Normal. O pedagogo, em empresas, atua em segmentos de treinamento de pessoal, recursos humanos, cursos empresariais, etc.<br />\r\n<br />\r\n<strong>Dura&ccedil;&atilde;o: </strong>06 semestres<br />\r\n&nbsp;</p>'),
(31, 3, 1, 9, 'Técnico em Eletrônica - Telecomunicações', 'O curso fornece uma formação sincronizada com diversos fundamentos científicos e tecnológicos de diversas áreas, além do curso concomitante do ensino médio.', '<p>&nbsp;Nas telecomunica&ccedil;&otilde;es o aluno vem encontrando &oacute;timas oportunidades e a &aacute;rea est&aacute; sendo cada vez mais ampliada. &Eacute; a &ldquo;Era da Comunica&ccedil;&atilde;o&rdquo; proporcionando aos T&eacute;cnicos em Telecomunica&ccedil;&otilde;es grandes possibilidadesde atua&ccedil;&atilde;o no mercado de trabalho.</p>\r\n<div>&nbsp;</div>\r\n<div>O curso fornece uma forma&ccedil;&atilde;o sincronizada com diversos fundamentos cient&iacute;ficos e tecnol&oacute;gicos de diversas &aacute;reas, al&eacute;m do curso concomitante do ensino m&eacute;dio.</div>\r\n<div>&nbsp;</div>\r\n<div><strong>&nbsp;Descri&ccedil;&atilde;o das Atividades</strong></div>\r\n<div>&nbsp;Desenvolve e executa projetos em sistemas e redes de telecomunica&ccedil;&otilde;es, estudando suas caracter&iacute;sticas, especifica&ccedil;&otilde;es e recursos necess&aacute;rios para possibilitar a montagem, funcionamento e manuten&ccedil;&atilde;o de instala&ccedil;&otilde;es e equipamentos afins.</div>\r\n<div>&nbsp;</div>\r\n<div><strong>&nbsp;Campos de Aplica&ccedil;&atilde;o Profissional</strong></div>\r\n<div>O campo de atua&ccedil;&atilde;o profissional para o T&eacute;cnico em Telecomunica&ccedil;&otilde;es &eacute; bastante extenso.</div>\r\n<div>&bull;<span class="Apple-tab-span" style="white-space:pre">	</span>A ind&uacute;stria &eacute; o setor que mais absorve este tipo de profissional, que poder&aacute; desempenhar suas fun&ccedil;&otilde;es em firmas especializadas na montagem de aparelhos de telefonia,radares, r&aacute;dio, televis&atilde;o e computadores entre outros, participando desde oprojeto industrial at&eacute; a inclus&atilde;o do produto no mercado consumidor.</div>\r\n<div>&bull;<span class="Apple-tab-span" style="white-space:pre">	</span>Em emissoras deR&aacute;dio e TV instalando antenas e aparelhos de transmiss&atilde;o e recep&ccedil;&atilde;o a cabo evia sat&eacute;lite.</div>\r\n<div>&bull;<span class="Apple-tab-span" style="white-space:pre">	</span>Nas empresas automobil&iacute;sticas, navais e aeron&aacute;uticas nas instala&ccedil;&otilde;es de redes entrecomputadores e maquin&aacute;rios de produ&ccedil;&atilde;o.</div>\r\n<div>&bull;<span class="Apple-tab-span" style="white-space:pre">	</span>Dentro do campo industrial, poder&aacute; dedicar-se, ainda, &agrave; &aacute;rea de vendas, onde existem produtosque exigem conhecimento t&eacute;cnico quanto &agrave; sua utiliza&ccedil;&atilde;o.</div>\r\n<div>&bull;<span class="Apple-tab-span" style="white-space:pre">	</span>Existe uma procura muito grande das chamadas &ldquo;Casas Inteligentes&rdquo;, nas quais opropriet&aacute;rio consegue atrav&eacute;s de um computador, acionar a dist&acirc;ncia diversos</div>\r\n<div>aparelhos eletr&ocirc;nicos.</div>\r\n<div>&bull;<span class="Apple-tab-span" style="white-space:pre">	</span>Nos &oacute;rg&atilde;os governamentais, hospitais, bancos e diversos setores p&uacute;blicos, onde se faznecess&aacute;ria &agrave; assessoria e consultoria relacionadas aos programas de instala&ccedil;&otilde;esde redes de telecomunica&ccedil;&otilde;es atrav&eacute;s de fibras &oacute;pticas.</div>\r\n<div>&bull;<span class="Apple-tab-span" style="white-space:pre">	</span>Em empresas de comuta&ccedil;&atilde;o telef&ocirc;nica, telegr&aacute;fica e telemetria.</div>\r\n<div><strong>&nbsp;Dura&ccedil;&atilde;o</strong></div>\r\n<div>Quatro anos, com est&aacute;gio supervisionado de 400h a partir dos 3&deg; anos.</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Hor&aacute;rios:</strong> 1&deg; e 2&deg; anos: das 07h &agrave;s 12h15 e das 19h15 &agrave;s 23h15</div>\r\n<div><strong>Hor&aacute;rios:</strong> 3&deg; e 4&deg; anos: das 19h15 &agrave;s 23h15.</div>'),
(32, 3, 1, 8, 'Técnico em Informática - Desenvolvimento de Sistemas', 'Tem o objetivo de capacitar o aluno a projetar, documentar, especificar, implementar, testar, implantar e manter sistemas computacionais de informação. Para tanto, o aluno utiliza modernas ferramentas computacionais', '<p>&nbsp;O Curso T&eacute;cnico de Desenvolvimento de Sistemas tem o objetivo de capacitar o aluno a projetar, documentar, especificar, implementar, testar, implantar e manter sistemas computacionais de informa&ccedil;&atilde;o. Para tanto, o aluno utiliza modernas ferramentas computacionais, bem como m&eacute;todos e t&eacute;cnicas avan&ccedil;adas para projetos aplicados durante todo o ciclo de desenvolvimento de sistemas, e conta, ainda, com professores altamente qualificados.</p>\r\n<div>&nbsp;</div>\r\n<div><strong>Atividades Principais</strong></div>\r\n<div>&nbsp;</div>\r\n<div>&bull; Projetar, desenvolver, implantar e manter Sistemas de Informa&ccedil;&atilde;o;</div>\r\n<div>&bull; diagnosticar problemas e propor melhorias baseadas em sistemas computacionais;</div>\r\n<div>&bull; aplicar adequadamente recursos computacionais (hardware e software);</div>\r\n<div>&bull; projetar e implementar Sistemas de Informa&ccedil;&atilde;o aderentes aos objetivos estrat&eacute;gicos das organiza&ccedil;&otilde;es;</div>\r\n<div>&bull; produzir software utilizando m&eacute;todos e t&eacute;cnicas adequadas e visando a alcan&ccedil;ar os atributos essenciais de software.</div>\r\n<div>&bull; Banco de Dados, como constru&ccedil;&atilde;o de banco de dados (modelagem de dados) utilizando SQL e Oracle.</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Mercado de Trabalho</strong></div>\r\n<div>&nbsp;</div>\r\n<div>&bull; Analista de Sistemas&nbsp;</div>\r\n<div>&bull; Projetista de Software&nbsp;</div>\r\n<div>&bull; Desenvolvedor de Software&nbsp;</div>\r\n<div>&bull; Gerente de Projetos de Sistemas de Informa&ccedil;&atilde;o</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Dura&ccedil;&atilde;o: </strong>&nbsp;4 anos</div>\r\n<div><strong>Est&aacute;gio supervisionado</strong><strong>:</strong> a partir do 3&deg; ano</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Hor&aacute;rios:</strong> 1&deg; e 2&deg; anos: das 07h &agrave;s 12h15 e das 19h15 &agrave;s 23h15</div>\r\n<div><strong>Hor&aacute;rios: </strong>3&deg; e 4&deg; anos: das 19h15 &agrave;s 23h15.</div>'),
(33, 3, 1, 8, 'Técnico em Informática para Internet', 'Técnico em Informática para Internet é responsável em desenvolver tecnologias de sistemas para internet. Aplicar as tecnologias para Gerenciamento, Gestão e Qualidade de Software voltados para WEB.', '<p>&nbsp;O T&eacute;cnico em Inform&aacute;tica para Internet &eacute; respons&aacute;vel em desenvolver tecnologias de sistemas para internet. Aplicar as tecnologias para Gerenciamento, Gest&atilde;o e Qualidade de Software voltados para WEB. Est&aacute; capacitado a proporcionar solu&ccedil;&otilde;es eficientes planejando, criando, produzindo e implementando aplica&ccedil;&otilde;es no ambiente web. Desenvolve sites est&aacute;ticos, din&acirc;micos e interativos. Atua em empresas de diferentes portes, ag&ecirc;ncias de comunica&ccedil;&atilde;o visual e digital, lidera ou integra equipes como aut&ocirc;nomo na presta&ccedil;&atilde;o de servi&ccedil;os.</p>\r\n<div>&Aacute;reas de atua&ccedil;&atilde;o e Perfil Profissional:</div>\r\n<div>Diretrizes para um profissional web:</div>\r\n<div>Comunica&ccedil;&atilde;o + Tecnologia + Empreendedorismo&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div><strong>A WEB incorpora e compartilha:</strong></div>\r\n<div>&bull; &nbsp; &nbsp;Tecnologia</div>\r\n<div>&bull; &nbsp; &nbsp;Comunica&ccedil;&atilde;o</div>\r\n<div>&bull; &nbsp; &nbsp;Informa&ccedil;&atilde;o</div>\r\n<div>&bull; &nbsp; &nbsp;Entretenimento</div>\r\n<div>&bull; &nbsp; &nbsp;Com&eacute;rcio</div>\r\n<div>&bull; &nbsp; &nbsp;Administra&ccedil;&atilde;o</div>\r\n<div>&bull; &nbsp; &nbsp;Gest&atilde;o e log&iacute;stica</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Mercado de Trabalho:</strong></div>\r\n<div>&bull; &nbsp; &nbsp;Conectividade</div>\r\n<div>&bull; &nbsp; &nbsp;Mobilidade</div>\r\n<div>&bull; &nbsp; &nbsp;Ubiquidade (presente em toda parte)</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Web Editor:</strong></div>\r\n<div>&bull; Realiza pesquisa de mercado para web</div>\r\n<div>&bull; Investiga as necessidades do cliente</div>\r\n<div>&bull; Planeja os elementos estruturais do site</div>\r\n<div>&bull; Produz o projeto web site de acordo com o padr&otilde;es internacionais da W3C</div>\r\n<div>&bull; Utiliza os conceitos de Navega&ccedil;&atilde;o e Arquitetura de Informa&ccedil;&atilde;o</div>\r\n<div>&bull; Aplica as normas de Web Standard,&nbsp;</div>\r\n<div>&bull; Utiliza os conceitos de usabilidade e acessibilidade para definir a estrutura do projeto</div>\r\n<div>&bull; Desenvolve habilidades no uso de linguagem de marca&ccedil;&atilde;o de texto, recursos de formata&ccedil;&atilde;o de estilo, imagens e anima&ccedil;&otilde;es ilustrativas</div>\r\n<div>&bull; Acompanha os padr&otilde;es internacionais vigentes da W3C</div>\r\n<div>&bull; Analise a viabilidade de aplicar ferramentas, &nbsp;aplicativos e componentes web&nbsp;</div>\r\n<div><strong><br />\r\n</strong></div>\r\n<div><strong>Web Designer:</strong></div>\r\n<div>&bull; Elabora layout de web site focando a comunica&ccedil;&atilde;o visual para a produ&ccedil;&atilde;o de sites</div>\r\n<div>&bull; Cria, formata e otimiza, imagens vetoriais e bitmaps, gr&aacute;ficos, anima&ccedil;&otilde;es e elementos visuais de navega&ccedil;&atilde;o para web</div>\r\n<div>&bull; Utiliza Tecnologias e Ferramentas para Web Design</div>\r\n<div>&bull; Produz, configura e publica web sites funcionais do ponto de vista est&eacute;tico</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Web Master</strong>:</div>\r\n<div>&bull; Desenvolve algoritmos utilizando o racioc&iacute;nio l&oacute;gico e programa&ccedil;&atilde;o aplicada</div>\r\n<div>&bull; Produz e implementa web sites din&acirc;micos atrav&eacute;s de anima&ccedil;&otilde;es programadas e acesso a banco de dados</div>\r\n<div>&bull; Desenvolve habilidades na utiliza&ccedil;&atilde;o de tecnologias de programa&ccedil;&atilde;o cliente/servidor</div>\r\n<div>&bull; Otimiza a estrutura de visualiza&ccedil;&atilde;o, o funcionamento e a manuten&ccedil;&atilde;o do sistema</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Web Developer:</strong></div>\r\n<div>&bull; Estrutura &nbsp;documentos para comunica&ccedil;&atilde;o entre aplica&ccedil;&otilde;es de diferentes plataformas e arquiteturas</div>\r\n<div>&bull; Produz e implementa sistemas distribu&iacute;dos e estruturados em m&oacute;dulos</div>\r\n<div>&bull; Produz web sites din&acirc;micos atendendo as necessidades do mercado</div>\r\n<div>&bull; Utiliza tecnologias que permitem maior intera&ccedil;&atilde;o e participa&ccedil;&atilde;o do usu&aacute;rio final</div>\r\n<div>&bull; Desenvolve jogos on-line&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Web Business:</strong></div>\r\n<div>&bull; Cria e produz plataformas de com&eacute;rcio eletr&ocirc;nico</div>\r\n<div>&bull; Cria gr&aacute;ficos visando efici&ecirc;ncia, confiabilidade e seguran&ccedil;a</div>\r\n<div>&bull; Cria controle para autentica&ccedil;&atilde;o</div>\r\n<div><strong><br />\r\n</strong></div>\r\n<div><strong>Empreendedor Web:</strong></div>\r\n<div>&bull; Identifica oportunidades de neg&oacute;cio</div>\r\n<div>&bull; Analisa a viabilidade mercadol&oacute;gica, econ&ocirc;mica e financeira</div>\r\n<div>&bull; Define as diretrizes estrat&eacute;gicas do empreendimento</div>\r\n<div>&bull; Planeja a abertura de uma empresa</div>\r\n<div>&bull; Analisa as habilidades e atitudes empreendedoras</div>\r\n<div>&bull; Elabora plano de neg&oacute;cio como ferramenta de gest&atilde;o e organiza&ccedil;&atilde;o</div>\r\n<div>&bull; Desenvolve habilidades na defini&ccedil;&atilde;o de estrat&eacute;gias minimizando riscos e aumentando a chance de sucesso do empreendimento</div>\r\n<div>&bull; Define estrat&eacute;gias de comercializa&ccedil;&atilde;o, utilizando a an&aacute;lise de ambiente de neg&oacute;cios</div>\r\n<div>&bull; Define o processo operacional do empreendimento atrav&eacute;s da an&aacute;lise da estrutura f&iacute;sica e dos recursos materiais</div>\r\n<div>&bull; Planeja a arquitetura organizacional, definindo sua estrutura e suas fun&ccedil;&otilde;es ocupacionais e administrativas</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Componentes Disciplinares:</strong></div>\r\n<div>- Fundamentos da Inform&aacute;tica</div>\r\n<div>- L&oacute;gica de Programa&ccedil;&atilde;o</div>\r\n<div>- Linguagem de Programa&ccedil;&atilde;o</div>\r\n<div>- Linguagem de Programa&ccedil;&atilde;o Web</div>\r\n<div>- Ferramentas para Web Design</div>\r\n<div>- An&aacute;lise de Sistemas</div>\r\n<div>- Tecnologia da Informa&ccedil;&atilde;o</div>\r\n<div>- Banco de Dados</div>\r\n<div>- Redes de Computadores e Sistemas Operacionais</div>\r\n<div>- T&eacute;cnicas de Opera&ccedil;&atilde;o e Suporte</div>\r\n<div>- Neg&oacute;cios e Finan&ccedil;as</div>\r\n<div>- Empreendedorismo</div>\r\n<div>- Projetos (TCC)</div>\r\n<div><strong><br />\r\n</strong></div>\r\n<div><strong>Dura&ccedil;&atilde;o: </strong>&nbsp;4 anos</div>\r\n<div><strong>Est&aacute;gio supervisionado:</strong> a partir do 3&deg; ano</div>\r\n<div><strong>Hor&aacute;rios:</strong> 1&deg; e 2&deg; anos: das 07h &agrave;s 12h15 e das 19h15 &agrave;s 23h15</div>\r\n<div><strong>Hor&aacute;rios: </strong>3&ordm; e 4&ordm; anos: das 19h15 &agrave;s 23h15</div>'),
(34, 3, 1, 8, 'Técnico em Informática - Redes de Computadores', 'Capacitar profissionais de nível técnico para conceber, projetar, desenvolver e gerenciar a utilização de redes. Proporcionar aos alunos os conhecimentos teóricos e técnicos.', '<p>&nbsp;Capacitar profissionais de n&iacute;vel t&eacute;cnico para conceber, projetar, desenvolver e gerenciar a utiliza&ccedil;&atilde;o de redes. Proporcionar aos alunos os conhecimentos te&oacute;ricos e t&eacute;cnicos, usualmente empregados nas redes de computadores. Habilitar os profissionais para o mercado de trabalho.</p>\r\n<div>O tecn&oacute;logo em redes de computadores pode atuar em diversas &aacute;reas, incluindo empresas operadoras de telefonia fixa, m&oacute;vel, grandes e m&eacute;dias corpora&ccedil;&otilde;es, fabricantes multinacionais de equipamentos, empresas de internet, entre outros, provendo conhecimentos e capacita&ccedil;&otilde;es que possibilitam a interconex&atilde;o de sistemas de tecnologia da informa&ccedil;&atilde;o por meio de redes de computadores, interconectadas por enlaces de transmiss&atilde;o de dados. Podem atuar tamb&eacute;m como aut&ocirc;nomos ou empres&aacute;rios.&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Principais &aacute;reas de atua&ccedil;&atilde;o:</strong></div>\r\n<div>&bull; &nbsp; &nbsp;Suporte T&eacute;cnico: Conhecimento em Hardware para manuten&ccedil;&atilde;o em computadores. Conhecimento de aplica&ccedil;&otilde;es de automa&ccedil;&atilde;o de escrit&oacute;rio (office). Conhecimento de sistema operacional desktop;</div>\r\n<div>&bull; &nbsp; &nbsp;Projetista de Rede: Elaborar projetos de infraestrutura rede para suportar os diversos servi&ccedil;os de rede, especificar equipamentos de redes, configura&ccedil;&atilde;o de equipamentos de redes. Conhecimento de protocolos;</div>\r\n<div>&bull; &nbsp; &nbsp;Administrador de Redes: Respons&aacute;vel pela configura&ccedil;&atilde;o de sistemas operacionais de rede e desktop. Elaborar pol&iacute;ticas de seguran&ccedil;a. Configurar e manter o funcionamento de servi&ccedil;os de rede como: Arquivos e impress&atilde;o, Autentica&ccedil;&atilde;o, DNS, Web, Firewall b&aacute;sico, Implanta&ccedil;&atilde;o de telefonia IP, etc.;</div>\r\n<div>&bull; &nbsp; &nbsp;Gerente de Rede: &Eacute; respons&aacute;vel por manter a rede de computadores de uma organiza&ccedil;&atilde;o funcionando de forma adequada e eficiente. Como tarefas tamb&eacute;m deve cuidar da seguran&ccedil;a desta rede, evitando ataques de hackers, crackers, etc.</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Dura&ccedil;&atilde;o:</strong> &nbsp;4 anos</div>\r\n<div><strong>Est&aacute;gio supervisionado:</strong> a partir do 3&deg; ano</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Hor&aacute;rios:</strong> 1&deg; e 2&deg; anos: das 07h &agrave;s 12h15 e das 19h15 &agrave;s 23h15</div>\r\n<div><strong>Hor&aacute;rios:</strong> 3&deg; e 4&deg; anos: das 19h15 &agrave;s 23h15.</div>'),
(35, 3, 2, 10, 'Modular em Construção Civil', 'O curso técnico modular em Construção Civil é voltado a profissionais que já possuam o ensino médio completo e que desejam adicionar à sua formação um curso técnico em construção civil.', '<p>&nbsp;O curso t&eacute;cnico modular em Constru&ccedil;&atilde;o Civil &eacute; voltado a profissionais que j&aacute; possuam o ensino m&eacute;dio completo e que desejam adicionar &agrave; sua forma&ccedil;&atilde;o um curso t&eacute;cnico em constru&ccedil;&atilde;o civil.</p>\r\n<div>Para tanto, o curso conta com professores t&eacute;cnicos atuantes no mercado, engenheiros, arquitetos e top&oacute;grafos. Para a forma&ccedil;&atilde;o t&eacute;cnica a FITO disp&otilde;e de modernos laborat&oacute;rios de inform&aacute;tica, de Maquetaria, bibliotecas com acervo de livros e revistas especializadas, gin&aacute;sio de esportes, teatros greco-romanos para grandes eventos, al&eacute;m da Internet colocada &agrave; disposi&ccedil;&atilde;o de seus alunos.&nbsp;</div>\r\n<div>O t&eacute;cnico em Constru&ccedil;&atilde;o Civil pode atuar em projeto, constru&ccedil;&atilde;o, fiscaliza&ccedil;&atilde;o de obras, per&iacute;cia, planejamento, gerenciamento e manuten&ccedil;&atilde;o, nas seguintes &aacute;reas e aplica&ccedil;&otilde;es respectivas:</div>\r\n<div>- materiais: ind&uacute;strias de concreto e de pr&eacute;-moldados;</div>\r\n<div>- estrutura: edif&iacute;cios residenciais, comerciais, pontes, etc.;</div>\r\n<div>- hidr&aacute;ulica e saneamento: sistema de tratamento e de distribui&ccedil;&atilde;o de &aacute;gua, sistemas prediais de agua fria e agua quente em geral, aquecimento solar;</div>\r\n<div>- transporte e geotecnia: estradas, sistemas vi&aacute;rios, obras de terra, funda&ccedil;&otilde;es;</div>\r\n<div>- instala&ccedil;&otilde;es el&eacute;tricas de pequeno/medio porte;</div>\r\n<div>- administra&ccedil;&atilde;o e ger&ecirc;ncia, inform&aacute;tica e projetos arquitet&ocirc;nicos.&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div><strong>O t&eacute;cnico &eacute; habilitado para trabalhar em:&nbsp;</strong></div>\r\n<div>&bull; Escrit&oacute;rios de constru&ccedil;&atilde;o civil;&nbsp;</div>\r\n<div>&bull; Ind&uacute;strias;&nbsp;</div>\r\n<div>&bull; Empresas construtoras;&nbsp;</div>\r\n<div>&bull; Servi&ccedil;os p&uacute;blicos;&nbsp;</div>\r\n<div>&bull; Institui&ccedil;&otilde;es espec&iacute;ficas ligadas a engenharia.&nbsp;</div>\r\n<div>&nbsp;&nbsp;</div>\r\n<div><strong>Dura&ccedil;&atilde;o:</strong> 2 anos&nbsp;</div>\r\n<div><strong>Hor&aacute;rios:</strong> Per&iacute;odo noturno, das 19h15 22h30.</div>'),
(36, 3, 2, 18, 'Música', 'Destinado àqueles que buscam a profissionalização e/ou o aprimoramento dos conhecimentos musicais.  ', '<p>&nbsp;Destinado &agrave;queles que buscam a profissionaliza&ccedil;&atilde;o e/ou o aprimoramento dos conhecimentos musicais. &nbsp;Al&eacute;m das aulas de instrumento, a grade curricular &eacute; composta de disciplinas como: percep&ccedil;&atilde;o, r&iacute;tmica, estrutura&ccedil;&atilde;o musical, hist&oacute;ria da m&uacute;sica, reg&ecirc;ncia, arranjo, improvisa&ccedil;&atilde;o, inform&aacute;tica, tecnologia musical, pr&aacute;tica de conjunto e coral. Diploma de n&iacute;vel m&eacute;dio reconhecido pelo MEC.</p>'),
(37, 3, 6, 18, 'Música', 'Para aqueles que buscam uma iniciação musical ou para quem já possui conhecimentos e deseja ampliá-los.', '<p>Para aqueles que buscam uma inicia&ccedil;&atilde;o musical ou para quem j&aacute; possui conhecimentos e deseja ampli&aacute;-los. Al&eacute;m das aulas de instrumento, a grade curricular &eacute; composta pelas disciplinas de Percep&ccedil;&atilde;o Musical, R&iacute;tmica e Musicaliza&ccedil;&atilde;o (para crian&ccedil;as), aulas te&oacute;ricas que ajudam no desenvolvimento musical dos alunos, que tamb&eacute;m contam com v&aacute;rios grupos de pr&aacute;tica de conjunto e Coral (infantil e adulto). V&aacute;rias op&ccedil;&otilde;es de instrumentos: piano; teclado; &oacute;rg&atilde;o; acorde&atilde;o; canto; saxofone; flauta transversal e doce; clarinete e clarone; trompete; trombone; trompa; violino; viola; violoncelo; contrabaixo ac&uacute;stico e el&eacute;trico; guitarra; viol&atilde;o; cavaquinho; bateria; percuss&atilde;o.</p>'),
(38, 3, 6, 21, 'Dança', 'Para aqueles que buscam uma iniciação na dança ou para quem já possui conhecimentos e deseja ampliá-los. ', '<p>Para aqueles que buscam uma inicia&ccedil;&atilde;o teatral ou para quem j&aacute; possui conhecimentos e deseja ampli&aacute;-los. A grade curricular &eacute; composta pelas disciplinas de express&atilde;o c&ecirc;nica, express&atilde;o corporal e hist&oacute;ria do teatro, al&eacute;m de serem formados grupos teatrais para apresenta&ccedil;&otilde;es na regi&atilde;o. Turmas: infantil; juvenil e adulto.</p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify; "><span style="font-size:12.0pt;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;\r\nmso-fareast-language:PT-BR"><o:p></o:p></span></p>'),
(39, 3, 6, 22, 'Teatro', 'Para aqueles que buscam uma iniciação teatral ou para quem já possui conhecimentos e deseja ampliá-los.', '<p>&nbsp;Para aqueles que buscam uma inicia&ccedil;&atilde;o teatral ou para quem j&aacute; possui conhecimentos e deseja ampli&aacute;-los. A grade curricular &eacute; composta pelas disciplinas de express&atilde;o c&ecirc;nica, express&atilde;o corporal e hist&oacute;ria do teatro, al&eacute;m de serem formados grupos teatrais para apresenta&ccedil;&otilde;es na regi&atilde;o. Turmas: infantil; juvenil e adulto.</p>');
INSERT INTO `curso` (`id_curso`, `id_profile`, `id_categoria_curso`, `id_subcategoria_curso`, `titulo`, `resumen`, `contenido`) VALUES
(40, 3, 1, 23, 'Técnico em Comércio Exterior', 'Aos egressos do curso será possível vislumbrar, em curto prazo, colocação em um mercado de trabalho em expansão que anseia por profissionais hábeis no que tange a observação e a crítica', '<p>O aumento significativo da participa&ccedil;&atilde;o brasileira nas transa&ccedil;&otilde;es comerciais de &acirc;mbito internacional, a complexidade da legisla&ccedil;&atilde;o que normatiza tais pr&aacute;ticas, caracterizam a necessidade de profissionais com conhecimentos e habilidades diferenciadas para a operacionaliza&ccedil;&atilde;o dos procedimentos relativos a esse setor.</p>\r\n<div>Aos egressos do curso ser&aacute; poss&iacute;vel vislumbrar, em curto prazo, coloca&ccedil;&atilde;o em um mercado de trabalho em expans&atilde;o que anseia por profissionais h&aacute;beis no que tange a observa&ccedil;&atilde;o e a cr&iacute;tica, para aplicar procedimentos anal&iacute;ticos relacionados aos processos que envolvem a entrada e sa&iacute;da de mercadorias e servi&ccedil;os do pa&iacute;s, adotando postura respons&aacute;vel, participativa, com vis&atilde;o sist&ecirc;mica e empreendedora.</div>\r\n<div>&nbsp;</div>\r\n<div>O curso &eacute; oferecido de forma integrada, em tr&ecirc;s anos, sendo que o primeiro ano ter&aacute; aulas no per&iacute;odo diurno (matutino) e os demais anos no noturno, com um total de 3030 h mais 400h de est&aacute;gio profissional obrigat&oacute;rio. Requisito de acesso: ter conclu&iacute;do o Curso Fundamental.</div>\r\n<div>&nbsp;</div>\r\n<div>Na forma subseq&uuml;ente ou concomitante ser&aacute; oferecido em dois semestres ( 1 ano), no noturno totalizando 825h. Requisito de acesso: ter conclu&iacute;do o Ensino M&eacute;dio ou estar cursando o terceiro ano do E. M&eacute;dio.</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Dura&ccedil;&atilde;o do curso:</strong> 03 anos</div>\r\n<div>&nbsp;</div>\r\n<div><strong>Hor&aacute;rio:&nbsp;</strong></div>\r\n<div><strong>1&ordm; ano:</strong> de segunda a sexta feira, das 7h &agrave;s 12h15 e aos s&aacute;bados das 8h &agrave;s 12h00.</div>\r\n<div><strong>2&ordm;, 3&ordm; anos:</strong> das 19h15 &agrave;s 23h15min e aos s&aacute;bados das 8h &agrave;s 12h00.</div>');
