INSERT INTO `sf_news` (`id_news`, `id_profile`, `title`, `sub_title`, `body`, `date`, `summary`, `author`, `image`, `status`, `home`, `permalink`, `home_title`, `category`, `sticky`) VALUES
(14, 1, 'Jovem Pan Pela Vida - 2012', 'FITO é a primeira escola a participar do projeto Jovem Pan Pela Vida em 2012', '<p>&nbsp;No dia 6 de fevereiro, a Unidade 2 da Funda&ccedil;&atilde;o Instituto Tecnol&oacute;gico de Osasco - FITO (na Zona Norte de Osasco) recebeu a psic&oacute;loga Ana Laura Parlato, diretora da Cl&iacute;nica Viva, que ministrou uma palestra sobre os malef&iacute;cios do uso de Drogas aos estudantes do Ensino Fundamental e M&eacute;dio, do per&iacute;odo noturno. &nbsp;Esta apresenta&ccedil;&atilde;o deu in&iacute;cio, neste ano de 2012, a uma s&eacute;rie de palestras sobre o assunto e que faz parte do projeto Jovem Pan Pela Vida, Contra as Drogas.&nbsp;</p>\r\n<div>Com dez anos de exist&ecirc;ncia, o projeto da Jovem Pan vem sendo realizado em v&aacute;rias escolas de S&atilde;o Paulo e conta com a participa&ccedil;&atilde;o de v&aacute;rios profissionais de &aacute;reas afins. &nbsp;Nesta primeira palestra do ano, a apresentadora foi Ana Paula Parlato, psic&oacute;loga cl&iacute;nica e pedagoga, al&eacute;m de especialista em psicopedagogia e em recursos humanos. &nbsp;Ana Paula tamb&eacute;m levou uma mo&ccedil;a, de classe m&eacute;dia, que j&aacute; foi internada tr&ecirc;s vezes e, hoje, est&aacute; em recupera&ccedil;&atilde;o, para dar seu depoimento, o que chamou a aten&ccedil;&atilde;o dos estudantes presentes. &nbsp;A palestra foi repetida no dia 8 do mesmo m&ecirc;s para as turmas do matutino na mesma unidade da FITO.</div>', '2012-02-11', 'No dia 6 de fevereiro, a Unidade 2 da Fundação Instituto Tecnológico de Osasco - FITO (na Zona Norte de Osasco) recebeu a psicóloga Ana Laura Parlato, diretora da Clínica Viva, que ministrou uma palestra sobre os malefícios do uso de Drogas aos estudantes do Ensino Fundamental e Médio, do período noturno.', '', '14_jp.gif', '1', '1', 'Jovem-pan-pela-vida-2012', '', '0', '0'),
(16, 1, 'Duo Grafite no Conservatório Villa Lobos', '', '<p>No dia 17 de mar&ccedil;o o Conservat&oacute;rio Musical Villa Lobos apresentou um recital com o &ldquo;Duo Grafite&rdquo;, formado por Cassia Carrascoza (flauta - Orquestra Sinf&ocirc;nica Municipal de S&atilde;o Paulo) e Ricardo Bologna (percuss&atilde;o - Orquestra Sinf&ocirc;nica do Estado de S&atilde;o Paulo).<br />\r\nEm rara forma&ccedil;&atilde;o de flauta transversal e marimba, os m&uacute;sicos C&aacute;ssia Carrascoza e Ricardo Bologna s&atilde;o m&uacute;sicos de intensa atividade e de carreiras art&iacute;sticas reconhecidas. C&aacute;ssia Carrascoza &eacute; primeira flauta da Orquestra Sinf&ocirc;nica Municipal e da Jazz Sinf&ocirc;nica, enquanto Bologna &eacute; percussionista da Osesp e diretor art&iacute;stico do Percorso Ensemble.</p>\r\n<p><br />\r\n<strong>FORMATURA</strong><br />\r\nTamb&eacute;m no dia 20/03 ocorreu a formatura dos estudantes do curso t&eacute;cnico de m&uacute;sica do Conservat&oacute;rio Villa Lobos.&nbsp; Houve apresenta&ccedil;&otilde;es dos alunos, das orquestras e do coral do CMVL.<br />\r\n&nbsp;</p>', '2012-03-22', 'No dia 17 de março o Conservatório Musical Villa Lobos apresentou um recital com o “Duo Grafite”', '', '16_ipanema-beach-rio-de.jpg', '1', '1', 'Duo-grafite-no-conservatrio-villa-lobos', '', '0', '0'),
(17, 1, 'Izaías e seus Chorões & Quintal Brasileiro', '', '<p>No dia 24 de abril o Conservat&oacute;rio Musical Villa Lobos apresentou a inusitada jun&ccedil;&atilde;o de um tradicional grupo de choro com um refinado quinteto de cordas: Iza&iacute;as e seus Chor&otilde;es &amp; Quintal Brasileiro, que, juntos, apresentar&atilde;o um repert&oacute;rio bem brasileiro, que vai de Pixinguinha, Ernesto Nazareth at&eacute; Radam&eacute;s Gnatali e Villani-C&ocirc;rtes.<br />\r\n<strong>Iza&iacute;as e seus Chor&otilde;es</strong> &eacute; um conjunto regional de choro formado em S&atilde;o Paulo, no in&iacute;cio da d&eacute;cada de 70. Al&eacute;mdo bandolinista Iza&iacute;as Bueno de Almeida, o grupo conta com Israel Bueno de Almeida, que toca viol&atilde;o de sete cordas, entre outros integrantes.&nbsp; J&aacute; o<strong> Quintal Brasileiro</strong> &eacute; um quinteto de cordas formado em 2002, que tem roupagem erudita, mas sotaque e repert&oacute;rio popular. Sua proposta &eacute; a de tocar pe&ccedil;as de m&uacute;sica popular de maneira camer&iacute;stica.&nbsp; O grupo &eacute; integrado por Luiz Amato (violino), professor da UNESP; Esdras Rodrigues (violino) e Emerson de Biaggi (viola), professores da Unicamp; Adriana Holtz (violoncelo) e Ney Vasconcelos (contrabaixo), integrantes da OSESP.<br />\r\n&nbsp;</p>', '2012-04-26', 'No dia 24 de abril o Conservatório Musical Villa Lobos apresentou a inusitada junção de um tradicional grupo de choro com um refinado quinteto de cordas', '', '17_izaias.jpg', '1', '1', 'Iza-as-e-seus-chor-es-quintal-brasileiro', '', '0', '0'),
(18, 1, 'Qualidade de ensino destacada pelo ITA', '', '<p>A Presid&ecirc;ncia da Funda&ccedil;&atilde;o Instituto Tecnol&oacute;gico de Osasco &ndash; FITO recebeu, no dia 1&ordm; de mar&ccedil;o, um of&iacute;cio do Instituto Tecnol&oacute;gico da Aeron&aacute;utica (ITA) comunicando a classifica&ccedil;&atilde;o e aprova&ccedil;&atilde;o de Bruno Lucatto, formado em 2009 no Ensino M&eacute;dio da Funda&ccedil;&atilde;o.&nbsp; Nesse of&iacute;cio, o setor de vestibular do ITA comunica &ldquo;a admiss&atilde;o ao ITA/2012 de alunos que conclu&iacute;ram o Ensino M&eacute;dio e/ou Curso Preparat&oacute;rio nesse estabelecimento de ensino, o que bem demonstra a qualidade do ensino ministrado pelos seus professores&rdquo;, congratulando todo o corpo docente da FITO.<br />\r\nNo entanto &eacute;de costume quev&aacute;rios estudantes do Ensino M&eacute;dio da FITO entrem em &oacute;timos cursos e faculdades.&nbsp; Neste ano a rela&ccedil;&atilde;o &eacute; grande, somando-se estudantes das unidades 1 e 2 e do pr&oacute;prio Conservat&oacute;rio Musical Villa Lobos, como foi o caso de Max Augusto de Carvalho Santos, que se formou como t&eacute;cnico em M&uacute;sica no Conservat&oacute;rio no ano passado e noEnsino M&eacute;dio da FITO em 2010.&nbsp; Ele prestou e passou no vestibular da UNICAMP, tamb&eacute;m para o curso de M&uacute;sica.Nath&aacute;lia Contini, ex-estudante do Ensino M&eacute;dio da FITO, que &eacute; fan&aacute;tica pelo Pok&eacute;mon e por v&aacute;rias vezes jogou cosplay (um jogo no qual os jogadores se fantasiam como seus personagens preferidos), assumiu de vez seu gosto por V&iacute;deo Games: prestou vestibular na FATEC para o curso de Jogos Digitais e passou.&nbsp; &ldquo;Sempre gostei de animes (desenhos animados japoneses) e n&atilde;o vi outra sa&iacute;da a n&atilde;o ser tentar trabalhar com isso atrav&eacute;s de programa&ccedil;&atilde;o de v&iacute;deo games&rdquo;, comentou Nath&aacute;lia.<br />\r\nAssim como ela, Bruno e Max, muitos outros estudantes tamb&eacute;m galgaram e conseguiram entrar em boas faculdades, tais como nos cursos de Moda, Cinema e Design de Interiores da Anhembi-Morumbi; Ci&ecirc;ncias Biol&oacute;gicas da PUC; Rela&ccedil;&otilde;es P&uacute;blicas, Jornalismo e Publicidade na C&aacute;sper L&iacute;bero, e Direito na S&atilde;o Judas, entre outras.<br />\r\nTiago Cesar Silva, formado o ano passado como t&eacute;cnico em Gest&atilde;o Administrativa na Unidade 2 da FITO, passou no vestibular da C&aacute;sper L&iacute;bero no curso de Audiovisual.&nbsp; Segundo o ex-aluno de Gest&atilde;o, que em princ&iacute;pio pensava em prestar Direito, o curso e os professores da FITO contribu&iacute;ram na mudan&ccedil;a da escolha do curso, &ldquo;pois ajudaram a amadurecer essa escolha, tamb&eacute;m por meio de disciplinas como Marketing e Planejamento, por exemplo&rdquo;.<br />\r\nPara o Diretor Geral de Ensino da FITO, Eduardo Sakai, n&atilde;o &eacute; de hoje que estudantes da Funda&ccedil;&atilde;o passam em vestibulares de grandes e boas faculdades ou universidades. &ldquo;Procuramos preparar nossos alunos para a vida profissional futura, sim, mas nosso principal objetivo &eacute; desenvolver nesses estudantes valores referentes &agrave; cidadania, valores estes que os preparam, principalmente, para serem transformadores da sociedade&rdquo;.<br />\r\nSegundo Sakai, a proposta de ensino da FITO pode ser considerada tradicional, mas com a cren&ccedil;a no poder de c&aacute;tedra do professor, &ldquo;que tem toda a liberdade no preparo do conte&uacute;do de suas disciplinas, trabalhando sempre com os instrumentos que as novas tecnologias de educa&ccedil;&atilde;o e comunica&ccedil;&atilde;o proporcionam&rdquo;.&nbsp; Outras caracter&iacute;stica b&aacute;sica da filosofia da FITO explicada pelo seu Diretor Geral de Ensino &eacute; a parceria constante do trabalho solid&aacute;rio, sistem&aacute;tico e consistente da Escola com a Fam&iacute;lia na tarefa de educar os estudantes.</p>\r\n<p>&nbsp;</p>\r\n<p>Verifique abaixo a carta enviada.<br />\r\n&nbsp;</p>', '2012-03-01', 'O setor de vestibular do ITA comunica “a admissão ao ITA/2012 de alunos que concluíram o Ensino Médio e/ou Curso Preparatório nesse estabelecimento de ensino, o que bem demonstra a qualidade do ensino ministrado pelos seus professores”.', '', '18_fab_dcta_ita_2012_1.jpg', '1', '1', 'Qualidade-de-ensino-destacada-pelo-ita', '', '0', '0'),
(19, 1, 'Novo presidente da FITO: José Barbosa Coelho', 'Veja o perfil do novo presidenet da FITO.', '<p>Desde o dia 3 de abril a Funda&ccedil;&atilde;o Instituto Tecnol&oacute;gico de Osasco &ndash; FITO possui um novo presidente: Jos&eacute; Barbosa Coelho.&nbsp; Ele assumiu o cargo em lugar do Dr. Faisal Cury, que a partir de agora cuidar&aacute; de sua pr&eacute;-campanha para vereador em Osasco.<br />\r\nJos&eacute; Barbosa Coelho, ou simplesmente Barbosa, como todos o chamam, &eacute; qu&iacute;mico industrial e administrador de empresa, e por 34 anos trabalhou na Osram do Brasil, empresa multinacional de origem alem&atilde;, instalada em Osasco desde 1955.&nbsp; Ao se aposentar como Diretor de Recursos Humanos por essa ind&uacute;stria, Barbosa iniciou sua carreira pol&iacute;tica ao se eleger, pela primeira vez, vereador por Osasco em 1992.&nbsp; Durante essa primeira incurs&atilde;o na pol&iacute;tica, Barbosa foi escolhido como secret&aacute;rio municipal da Ind&uacute;stria e Com&eacute;rcio pelo ent&atilde;o prefeito Silas Bortolosso.&nbsp; Ap&oacute;s isso, acabou reeleito por mais quatro mandatos, sendo que entre 2003 e 2006 tamb&eacute;m foi, por duas vezes, presidente da C&acirc;mara Municipal.<br />\r\nBarbosa tem uma forte liga&ccedil;&atilde;o com a FITO, pois foi aluno do curso de Administra&ccedil;&atilde;o de Empresa na antiga FEAO (Faculdade de Economia e Administra&ccedil;&atilde;o de Osasco), que em 1969 foi incorporada &agrave; FITO, tornando-se ent&atilde;o a Faculdade de Ci&ecirc;ncias da FITO (FAC-FITO), al&eacute;m de participar de seu Conselho Diretor desde 2000.&nbsp; &ldquo;A FITO &eacute; uma institui&ccedil;&atilde;o que a popula&ccedil;&atilde;o considera de muita qualidade&rdquo;, lembrou Barbosa.&nbsp; &ldquo;Por isso ainda hoje os professores da FITO s&atilde;o refer&ecirc;ncia para muita gente, tanto que s&atilde;o convidados por outras institui&ccedil;&otilde;es de ensino para fazerem parte de seu corpo docente&rdquo;, comentou.<br />\r\nCom um bom acesso &agrave; classe empresarial de Osasco, Barbosa participa de coment&aacute;rios muito positivos sobre a Funda&ccedil;&atilde;o.&nbsp; &ldquo;Muitos estudantes do Ensino M&eacute;dio T&eacute;cnico s&atilde;o solicitados como estagi&aacute;rios pelas empresas locais, fato que tem aumentado a cada ano. Os empres&aacute;rios locais sabem que podem contar com a qualidade do ensino t&eacute;cnico promovido pela FITO&rdquo;, explicou.&nbsp; &ldquo;Por isso a grande procura por esses nossos estudantes&rdquo;.<br />\r\nBarbosa acredita que administrar uma Funda&ccedil;&atilde;o com esse porte &eacute;, antes de tudo, uma grande honra e um grande desafio. &ldquo;&Eacute; realmente uma honra participar diretamente da hist&oacute;ria desta Funda&ccedil;&atilde;o, que muito tem contribu&iacute;do com a popula&ccedil;&atilde;o de Osasco por mais de 40 anos. E &eacute; a&iacute;, tamb&eacute;m, onde se encontra meu maior desafio: o de dar continuidade a essa excel&ecirc;ncia&rdquo;, explicou.&nbsp; Segundo Barbosa, todo gestor, todo dirigente, tem de possuir um &ldquo;olho cl&iacute;nico&rdquo; para certas situa&ccedil;&otilde;es.&nbsp; &ldquo;Acredito que, em qualquer institui&ccedil;&atilde;o ou empresa, a fun&ccedil;&atilde;o do gestor n&atilde;o se d&aacute; de maneira solit&aacute;ria. No caso da FITO, especificamente, o gestor precisa da colabora&ccedil;&atilde;o de todo seu corpo administrativo e docente para que possa trabalhar em prol da institui&ccedil;&atilde;o e esta em prol da sociedade osasquense, seu p&uacute;blico direto&rdquo;, explicou o presidente da FITO. &ldquo;Para tanto precisamos motivar esses nossos colaboradores, aproximando-os entre si e promovendo, quando poss&iacute;vel, maior capacita&ccedil;&atilde;o funcional&rdquo;. <br />\r\nQuanto ao futuro da FITO, Barbosa &eacute; muito enf&aacute;tico: &ldquo;Acredito na capacidade dos homens, sejam eles p&uacute;blicos ou n&atilde;o, em investir em Educa&ccedil;&atilde;o&rdquo;.&nbsp; &ldquo;Sabemos que os dirigentes entre si pensam muito diferente, principalmente quanto a muitas quest&otilde;es p&uacute;blicas. Mas com rela&ccedil;&atilde;o &agrave; FITO, n&atilde;o tenho tanta preocupa&ccedil;&atilde;o, pois todos em Osasco conhecem o bem que &eacute; esta institui&ccedil;&atilde;o e tudo o que, por ventura, for realizado sempre ser&aacute; em benef&iacute;cio da popula&ccedil;&atilde;o. E ningu&eacute;m, em s&atilde; consci&ecirc;ncia, gostaria que a popula&ccedil;&atilde;o fosse deixada sem uma Educa&ccedil;&atilde;o de qualidade&rdquo;, encerrou.</p>', '2012-04-04', 'Desde o dia 3 de abril a FITO possui um novo presidente: José Barbosa Coelho.  Ele assumiu o cargo em lugar do Dr. Faisal Cury, que a partir de agora cuidará de sua pré-campanha para vereador em Osasco.', '', '19_barbosa_menor.jpg', '1', '1', 'Novo-presidente-da-fito-jos-barbosa-coelho', '', '0', '0'),
(20, 1, 'Hermeto Paschoal no Villa Lobos', '', '<p>Aconteceu no &uacute;ltimo dia 12 de junho no Conservat&oacute;rio Villa Lobos da FITO, uma apresenta&ccedil;&atilde;o com o compositor e multi-instrumentista Hermeto Paschoal. Por conta do show de abertura do &ldquo;Santos Jazz Festival&rdquo;, Hermeto fez um ensaio aberto junto com os instrumentistas e professores da Big Band do Conservat&oacute;rio Villa Lobos que ir&atilde;o tocar junto com o m&uacute;sico na abertura do festival que acontecer&aacute;&nbsp; entre os dias 14 e 17 de Junho de 2012 na cidade de Santos, litoral de S&atilde;o Paulo. A plateia foi composta por alunos dos cursos livres e t&eacute;cnicos de m&uacute;sica, ministrado pelo Conservat&oacute;rio, contou ainda com a presen&ccedil;a dos alunos do curso superior de m&uacute;sica da FITO.</p>', '2012-06-13', 'Aconteceu no último dia 12 de junho uma apresentação com o compositor e multi-instrumentista Hermeto Paschoal.', '', '20_cmvl.jpg', '1', '1', 'Hermeto-paschoal-no-villa-lobos', '', '0', '0'),
(21, 1, 'FITO: novo momento de gestão administrativa', 'Mudanças coincidem com a abertura de matrículas na instituição e com inscrições para o vestibular da FAC-Fito.', '<p><em>Mudan&ccedil;as coincidem com a abertura de matr&iacute;culas na institui&ccedil;&atilde;o e com inscri&ccedil;&otilde;es para o vestibular da FAC-Fito. &ldquo;Atualmente conseguimos eliminar culturas organizacionais negativas e muitos problemas est&atilde;o superados. Estamos arrumando a casa e emergindo. A Fito &eacute; uma f&ecirc;nix&rdquo;, afirma a diretora Marcize Garcia</em></p>\r\n<p>Renomada e tradicional p&oacute;lo de educa&ccedil;&atilde;o de Osasco, com 43 anos de exist&ecirc;ncia na cidade, a Fito (Funda&ccedil;&atilde;o Instituto Tecnol&oacute;gico de Osasco) hoje est&aacute; capacitada e mais qualificada para atender a demanda do mercado de trabalho do munic&iacute;pio e regi&atilde;o, principalmente com a readequa&ccedil;&atilde;o curricular recente dos cursos da FAC-Fito e devido &agrave; extin&ccedil;&atilde;o do sistema de concess&atilde;o de bolsas de estudo integrais, adotado por gest&otilde;es anteriores sem nenhum crit&eacute;rio, e que contribu&iacute;ram para o crescimento da d&iacute;vida da Funda&ccedil;&atilde;o. &nbsp;<br />\r\n&Eacute; o que asseguram o presidente da Fito e vice-prefeito de Osasco, Faisal Cury, e a diretora administrativa da institui&ccedil;&atilde;o, Marcize Garcia. Uma das consequ&ecirc;ncias dessa reorganiza&ccedil;&atilde;o, e que empolga a atual administra&ccedil;&atilde;o, &eacute; a redu&ccedil;&atilde;o da inadimpl&ecirc;ncia. Em 2005, o &iacute;ndice de estudantes inadimplentes chegava a 45%. A partir da nova gest&atilde;o a da implementa&ccedil;&atilde;o de uma nova pol&iacute;tica administrativa, esses n&uacute;meros ca&iacute;ram para atuais 15% e muito trabalho est&aacute; sendo realizado para diminuir ainda mais esta porcentagem, tendo em vista que a Fito possui aproximadamente 4 mil alunos, sendo 2,4 mil nas escolas de educa&ccedil;&atilde;o b&aacute;sica. <br />\r\nCriada em outubro de 1968, a Fito &eacute; uma Funda&ccedil;&atilde;o P&uacute;blica da administra&ccedil;&atilde;o indireta e que possui personalidade jur&iacute;dica de direito p&uacute;blico, dotada de plena autonomia administrativo-financeira e com privativa compet&ecirc;ncia para gest&atilde;o de seus bens e recursos, sem fins lucrativos. Atualmente a institui&ccedil;&atilde;o mant&eacute;m tr&ecirc;s unidades de ensino, na cidade, com turmas no Ensino Fundamental, M&eacute;dio e M&eacute;dio T&eacute;cnico, al&eacute;m do Conservat&oacute;rio Musical Villa Lobos, que mant&eacute;m caracter&iacute;sticas independentes e despolitizadas, conforme explica Cury. &ldquo;Hoje a Fito n&atilde;o &eacute; mais usada politicamente. A nossa administra&ccedil;&atilde;o mudou e nosso limite de bolsas de estudo social, por exemplo, &eacute; de 40% ap&oacute;s an&aacute;lise criteriosa com visita&ccedil;&atilde;o &agrave; casa dos solicitantes. Bolsas acima de 50% s&atilde;o submetidas ao Conselho. Temos 28 mil bolsas distribu&iacute;das e muito controle&rdquo;, revela. <br />\r\nJ&aacute; Marcize destaque que a atual administra&ccedil;&atilde;o trabalha arduamente para que a Fito e tamb&eacute;m a FAC-Fito melhorem. &quot;E isso j&aacute; acontece. Estamos passando por readequa&ccedil;&otilde;es financeiras e contamos com uma disputa de mercado grande de outras institui&ccedil;&otilde;es de ensino em Osasco. Precisamos estar atualizados e estamos&rdquo;, afirma. <br />\r\nProva de que melhorias s&atilde;o realizadas foi a constru&ccedil;&atilde;o do novo pr&eacute;dio da Fac-Fito, entregue em fevereiro deste ano, que marca a fase de fortalecimento e expans&atilde;o da faculdade. Na ocasi&atilde;o, foram constru&iacute;dos 20 salas de aula, 3 laborat&oacute;rios de inform&aacute;tica, sendo 1 deles duplo, com mais de 50 computadores e outros tr&ecirc;s de Eletro-t&eacute;cnica, F&iacute;sica e Eletr&ocirc;nica, exclusivos para alunos do curso de Engenharia El&eacute;trica para 110 pessoas em uma &aacute;rea de 3,8 mil m&sup2;. As novas instala&ccedil;&otilde;es possuem ainda audit&oacute;rio, biblioteca, sala de estudo, lanchonete e uma extensa &aacute;rea arborizada. O novo espa&ccedil;o pode atender 1,2 mil estudantes dos cursos de Administra&ccedil;&atilde;o, Ci&ecirc;ncias Cont&aacute;beis, Ci&ecirc;ncias Econ&ocirc;micas, Ci&ecirc;ncias da Computa&ccedil;&atilde;o e Engenharia El&eacute;trica. O n&uacute;mero atual de alunos da faculdade &eacute; de 900 estudantes.&nbsp; &nbsp;<br />\r\nDe acordo com Marcize, s&atilde;o in&uacute;meras as a&ccedil;&otilde;es para melhor atender ao estudante e por isso, a institui&ccedil;&atilde;o criou at&eacute; uma Ouvidoria com o objetivo de analisar o &iacute;ndice de evas&atilde;o de estudantes do col&eacute;gio e com isso estabelecer um plano de a&ccedil;&atilde;o para fideliz&aacute;-los. &ldquo;&Eacute; importante assegurarmos o sigilo ao aluno e detectar o que acontece na institui&ccedil;&atilde;o que os olhos administrativos algumas vezes n&atilde;o alcan&ccedil;am, at&eacute; mesmo porque somos humanos. Pensando dessa forma, h&aacute; tamb&eacute;m hoje muito mais transpar&ecirc;ncia na administra&ccedil;&atilde;o e toda nossa contabilidade &eacute; aberta &agrave; comunidade para que todos saibam nossas despesas e receitas&rdquo;, explica. <br />\r\n&nbsp; <br />\r\n<strong>Vestibular 2012 </strong><br />\r\nA FAC-Fito (Faculdade de Ci&ecirc;ncias da Funda&ccedil;&atilde;o Instituto Tecnol&oacute;gico de Osasco) est&aacute; com inscri&ccedil;&otilde;es abertas, at&eacute; 5 de novembro, para seu vestibular 2012. A institui&ccedil;&atilde;o oferece cursos de Administra&ccedil;&atilde;o, Ci&ecirc;ncias Cont&aacute;beis, Ci&ecirc;ncias Econ&ocirc;micas, Engenharia El&eacute;trica, Pedagogia e M&uacute;sica, al&eacute;m de uma novidade para o pr&oacute;ximo ano: Curso Superior em Tecnologia &ndash; An&aacute;lise e Desenvolvimento de Sistemas), com dura&ccedil;&atilde;o de 2 anos e meio. <br />\r\nO cadastramento pode ser feito no site www.fito.edu.br. Mais informa&ccedil;&otilde;es nos telefones 3652-3000, 3652-3090 ou 3652-3049. A FAC-Fito fica na rua Cam&eacute;lia, 26, no Jardim das Flores. <br />\r\n&nbsp; <br />\r\n<strong>Vagas na FITO </strong><br />\r\nA Fito est&aacute; com matr&iacute;culas abertas para o ano letivo de 2012. A inscri&ccedil;&atilde;o mant&eacute;m turmas de Ensino Fundamental (1&ordm; ao 9&ordm; ano) e Ensino M&eacute;dio, al&eacute;m de Ensino M&eacute;dio T&eacute;cnico nos cursos de Administra&ccedil;&atilde;o, Edifica&ccedil;&otilde;es, Eletr&ocirc;nica, Enfermagem, Inform&aacute;tica e M&uacute;sica e ainda cursos T&eacute;cnicos Modulares em Edifica&ccedil;&otilde;es, Enfermagem e em novas modalidades para o pr&oacute;ximo ano: Administra&ccedil;&atilde;o de Empresas, Administra&ccedil;&atilde;o P&uacute;blica, Recursos Humanos e Transa&ccedil;&otilde;es Imobili&aacute;rias. <br />\r\nAl&eacute;m disso, oferece cursos livres de M&uacute;sica, Dan&ccedil;a e Teatro. Informa&ccedil;&otilde;es sobre o processo de matr&iacute;culas podem ser obtidas no site www.fito.edu.br ou pelos telefones 3652-3000 ou 3602-7900.<br />\r\n&nbsp;</p>', '2011-10-13', 'Mudanças coincidem com a abertura de matrículas na instituição e com inscrições para o vestibular da FAC-Fito. “Atualmente conseguimos eliminar culturas organizacionais negativas e muitos problemas estão superados. Estamos arrumando a casa e emergindo. A Fito é uma fênix”, afirma a diretora Marcize Garcia', '', '21_dsc00824_menor.jpg', '1', '1', 'Fito-novo-momento-de-gest-o-administrativa', '', '0', '0'),
(22, 1, 'Estudantes de Pedagogia da FITO defendem TCC', '', '<p>Entre os pr&oacute;ximos dias 22 e 25 de maio, professoras da rede municipal de ensino, beneficiadas com a pol&iacute;tica de forma&ccedil;&atilde;o continuada da Prefeitura Municipal de Osasco, por meio da Secretaria de Educa&ccedil;&atilde;o, apresentar&atilde;o seus Trabalhos de Conclus&atilde;o de Curso (TCC).<br />\r\nAlunas do curso de Pedagogia da Faculdade de Ci&ecirc;ncias da FITO (FAC-FITO), as&nbsp; futuras&nbsp; professoras investigaram temas voltados &agrave; pr&aacute;tica e teoria pedag&oacute;gicas. O papel da fam&iacute;lia em alian&ccedil;a com a escola; a inclus&atilde;o de crian&ccedil;as com defici&ecirc;ncia; legisla&ccedil;&atilde;o aplicada na educa&ccedil;&atilde;o: dicotomia entre legisla&ccedil;&atilde;o e pr&aacute;tica na escola, e o papel do desenho no processo de alfabetiza&ccedil;&atilde;o s&atilde;o alguns dos v&aacute;rios assuntos trabalhados pelas estudantes.<br />\r\nSegundo a diretora da FAC-FITO, prof&ordf; Dra. Maria de Lourdes Ramos da Silva, os trabalhos buscam refletir &quot;a concilia&ccedil;&atilde;o entre teoria e pr&aacute;tica, t&atilde;o necess&aacute;ria ao trabalho de sala de aula&quot;. <br />\r\nOs trabalhos s&atilde;o acompanhados por professores das diferentes disciplinas e pela coordenadora do curso, prof&ordf; Dra. Marina Pereira de Almeida Melo, que diz que &quot;o fato de as estudantes j&aacute; terem pr&aacute;tica em sala de aula contribuiu com a resignifica&ccedil;&atilde;o de seu papel e de sua atua&ccedil;&atilde;o no complexo processo de aprendizagem&quot;.<br />\r\nAs apresenta&ccedil;&otilde;es ocorrer&atilde;o no Audit&oacute;rio da FAC-FITO, na Av. Get&uacute;lio Vargas, 990 - Jardim Piratininga, a partir das 19h30.<br />\r\n&nbsp;</p>', '2012-05-19', 'Professoras da rede pública de Osasco, estudantes do curso de Pedagogia da FITO, defendem Trabalho de Conclusão de Curso.', '', '22_6.jpg', '1', '1', 'Estudantes-de-pedagogia-da-fito-defendem-tcc', '', '0', '0'),
(23, 1, 'VIII Concurso de Piano do Conservatório Villa Lobos da FITO', '', '<p>As inscri&ccedil;&otilde;es para o VIII Concurso de Piano do CMVL poder&atilde;o ser feitas at&eacute; o dia 15 de setembro de 2012.&nbsp; O concurso &eacute; dirigido a todos os alunos de escolas de m&uacute;sica ou de professores particulares e tem por objetivo estimular o aprimoramento do estudo de piano e fomentar a pr&aacute;tica de apresenta&ccedil;&atilde;o em p&uacute;blico. O j&uacute;ri ser&aacute; composto por tr&ecirc;s m&uacute;sicos de renome no meio musical, n&atilde;o podendo dele participar professor que tiver aluno inscrito no concurso.<br />\r\nOs participantes poder&atilde;o inscrever-se de acordo com a idade, nos seguintes turnos:<br />\r\n<strong>1&ordm; turno:</strong> at&eacute; 10 anos completos na data do concurso.<br />\r\n<strong>2&ordm; turno: </strong>de 11 a 14 anos completos na data do concurso.<br />\r\n<strong>3&ordm; turno: </strong>de 15 a 18 anos completos na data do concurso.<br />\r\n<strong>4&ordm; turno:</strong> a partir de 19 anos.<br />\r\nHaver&aacute; uma &uacute;nica prova para todos os turnos a ser realizada no dia <strong>22 de setembro de 2012</strong> na Sala de Recitais Edna Baldassi, do Conservat&oacute;rio, nos seguintes hor&aacute;rios:<br />\r\n<strong>1&ordm; e 2&ordm; turnos &ndash; 10 h<br />\r\n3&ordm; e 4&ordm; turnos &ndash; 14h30min</strong><br />\r\nOs candidatos dever&atilde;o se apresentar no local da prova com pelo menos 30 minutos de anteced&ecirc;ncia.&nbsp; Poder&atilde;o ser feitos ensaios no dia anterior (21 de setembro), agendados previamente na secretaria, pelos telefones: 3652-3018 ou 3652-3043.<br />\r\n&nbsp;</p>\r\n<p><strong>Programa: </strong><br />\r\nOs candidatos do 1&ordm; e 2&ordm; turnos dever&atilde;o executar duas pe&ccedil;as de livre escolha, sendo que uma dever&aacute; ser do compositor brasileiro Amaral Vieira. Os candidatos do 3&ordm; e 4&ordm; turnos dever&atilde;o executar tr&ecirc;s pe&ccedil;as sendo: uma do compositor brasileiro Amaral Vieira e duas de livre escolha.<br />\r\nOs candidatos dever&atilde;o trazer no dia do concurso uma c&oacute;pia para o j&uacute;ri das obras a serem apresentadas.&nbsp; O tempo total de execu&ccedil;&atilde;o da prova n&atilde;o poder&aacute; ultrapassar 20 minutos.<br />\r\nAlgumas obras do compositor Amaral Vieira est&atilde;o dispon&iacute;veis na Thesaurus Music &ndash; Rua Tef&eacute;, 31,&nbsp; bairro Sumar&eacute;, S&atilde;o Paulo, tel.(11) 3567 2895 (falar c/ Neilza) e tamb&eacute;m na secretaria do Conservat&oacute;rio. <br />\r\n&nbsp;</p>\r\n<p><strong>Pr&ecirc;mios:</strong><br />\r\nHaver&aacute; medalhas para os tr&ecirc;s primeiros colocados de cada turno e certificados de participa&ccedil;&atilde;o para todos os candidatos.&nbsp; O primeiro lugar ganhar&aacute; direito a um recital no Conservat&oacute;rio Musica Villa Lobos, a ser agendado para o ano de 2013.&nbsp; Outros pr&ecirc;mios tamb&eacute;m ser&atilde;o atribu&iacute;dos e conhecidos na ocasi&atilde;o da realiza&ccedil;&atilde;o do concurso.</p>\r\n<p><br />\r\n<strong>Servi&ccedil;o:</strong><br />\r\nO candidato dever&aacute; enviar os dados de inscri&ccedil;&atilde;o para a secretaria do conservat&oacute;rio, no e-mail: concursodepiano@fito.edu.br e aguardar confirma&ccedil;&atilde;o da mesma via e-mail.&nbsp; Os telefones para contato s&atilde;o: 3652-3018 e 3652-3043. </p>', '2012-07-23', 'As inscrições para o VIII Concurso de Piano do CMVL poderão ser feitas até o dia 15 de setembro de 2012.', '', '23_piano-keys.jpg', '1', '1', 'Viii-concurso-de-piano-do-conservat-rio-villa-lobos-da-fito', '', '0', '0'),
(24, 1, 'Ex-estudantes da FITO entram em ótimas faculdades', '', '<p>Como de costume, em todos os anos, muitos estudantes que terminam o Ensino M&eacute;dio na Funda&ccedil;&atilde;o Instituto Tecnol&oacute;gico de Osasco &ndash; FITO conseguem entrar em &oacute;timos cursos e faculdades.&nbsp; A rela&ccedil;&atilde;o &eacute; grande, somando-se estudantes das unidades 1 e 2 e do pr&oacute;prio Conservat&oacute;rio Musical Villa Lobos, como foi o caso de Max Augusto de Carvalho Santos, que se formou como t&eacute;cnico em M&uacute;sica no ano passado, prestou e passou no vestibular da UNICAMP, tamb&eacute;m para o curso de M&uacute;sica.&nbsp; Max tamb&eacute;m havia se formado no Ensino M&eacute;dio, em 2010, na pr&oacute;pria FITO.<br />\r\nNath&aacute;lia Contini, ex-estudante do Ensino M&eacute;dio da FITO, que &eacute; fan&aacute;tica pelo Pok&eacute;mon e por v&aacute;rias vezes jogou cosplay (um jogo no qual os jogadores se fantasiam como seus personagens preferidos), assumiu de vez seu gosto por V&iacute;deo Games: prestou vestibular na FATEC para o curso de Jogos Digitais e passou.&nbsp; &ldquo;Sempre gostei de animes (desenhos animados japoneses) e n&atilde;o v&iacute; outra sa&iacute;da a n&atilde;o ser tentar trabalhar com isso atrav&eacute;s de programa&ccedil;&atilde;o de v&iacute;deo games&rdquo;, comentou Nath&aacute;lia.<br />\r\nAssim como ela, muitos outros estudantes tamb&eacute;m galgaram e conseguiram entrar em boas faculdades, tais como nos cursos de Moda, Cinema e Design de Interiores da Anhembi-Morumbi; Ci&ecirc;ncias Biol&oacute;gicas da PUC; Rela&ccedil;&otilde;es P&uacute;blicas, Jornalismo e Publicidade na C&aacute;sper L&iacute;bero, e Direito na S&atilde;o Judas, entre outras.<br />\r\nTiago Cesar Silva, formado o ano passado como t&eacute;cnico em Gest&atilde;o Administrativa na Unidade 2 da FITO, passou no vestibular da C&aacute;sper L&iacute;bero no curso de Audiovisual.&nbsp; Segundo o ex-aluno de Gest&atilde;o, que em princ&iacute;pio pensava em prestar Direito, o curso e os professores da FITO contribu&iacute;ram na mudan&ccedil;a da escolha do curso, &ldquo;pois ajudaram a amadurecer essa escolha, tamb&eacute;m por meio de disciplinas como Marketing e Planejamento, por exemplo&rdquo;.<br />\r\n&nbsp;</p>', '2012-03-05', 'Como de costume, em todos os anos, muitos estudantes que terminam o Ensino Médio na Fundação Instituto Tecnológico de Osasco – FITO conseguem entrar em ótimos cursos e faculdades.', '', '24_vest-aprovados.jpg', '1', '1', 'Ex-estudantes-da-fito-entram-em-timas-faculdades', '', '0', '0'),
(25, 1, 'Estudantes da FITO visitam USP', '', '<p>No pr&oacute;ximo dia 11 de outubro (5&ordf; feira), os estudantes do 9&ordm; ano A da Unidade II&nbsp;far&atilde;o uma visita ao Parque Cien Tec &ndash; USP, em S&atilde;o Paulo.&nbsp; Nessa sa&iacute;da os alunos ter&atilde;o a oportunidade de visitar o &ldquo;Espa&ccedil;o da F&iacute;sica&rdquo; onde poder&atilde;o conhecer formas de energias alternativas e manusear equipamentos ligados &agrave; est&aacute;tica, eletricidade, eletromagnetismo, &oacute;tica, hidr&aacute;ulica, etc., assuntos do repert&oacute;rio das aulas de Ci&ecirc;ncias.&nbsp;&nbsp; Os estudantes sair&atilde;o da Escola &agrave;s 7h e ser&atilde;o acompanhados por professores da s&eacute;rie e por monitoria especializada.</p>', '2012-08-30', 'Alunos do 9º ano farão uma visita ao Parque CienTec da USP.', '', '25_dscn2495.jpg', '1', '1', 'Estudantes-da-fito-visitam-usp', '', '0', '0'),
(26, 1, 'FITO no Desfile de Sete de Setembro de 2012', '', '<p>Estudantes e professores da FITO fizeram bonito durante as comemora&ccedil;&otilde;es do Dia da independ&ecirc;ncia, quando desfilaram pela Av. dos Autonomistas. Cerca de 200 estudantes participaram do desfile de Sete de Setembro, se apresentando a mais de cinco mil pessoas que observaram as diversas institui&ccedil;&otilde;es de Osasco que foram aplaudidas pelas autoridades presentes, entre elas o prefeito Em&iacute;dio de Souza, a primeira dama e secret&aacute;rios que acompanharam o evento.</p>', '2012-09-10', 'Estudantes e professores da FITO fizeram bonito durante as comemorações do Dia da independência.', '', '26_maracana-stadium-rio.jpg', '1', '1', 'Fito-no-desfile-de-sete-de-setembro', '', '0', '0'),
(27, 1, 'Encontro com a Arte na Unidade II', '', '<p>&nbsp;A Unidade II promover&aacute;, no pr&oacute;ximo dia 22 de setembro, uma tarde diferente para pais e estudantes: &eacute; o Encontro com a Arte, que ocorrer&aacute; entre 14h e 17h desse dia. &nbsp;Os estudantes do Ensino Fundamental e Ensino M&eacute;dio apresentar&atilde;o aos pais e presentes seus trabalhos art&iacute;sticos, liter&aacute;rios, c&ecirc;nicos e musicais.&nbsp;</p>\r\n<div>Algumas apresenta&ccedil;&otilde;es especiais est&atilde;o sendo preparadas, como a participa&ccedil;&atilde;o de um Contador de Hist&oacute;rias, shows especiais, pe&ccedil;as teatrais e v&aacute;rias outras atividades ligadas &agrave; Arte. &nbsp;Divulguem e convidem seus amigos e parentes, pois o Encontro com a Arte ser&aacute; aberta ao p&uacute;blico.</div>', '2012-09-11', 'A Unidade II promoverá, no próximo dia 22 de setembro, uma tarde diferente para pais e estudantes: é o Encontro com a Arte, que ocorrerá entre 14h e 17h desse dia.', '', '27_08-places-lifetime-t.jpg', '1', '1', 'Encontro-com-a-arte-na-unidade-ii', '', '0', '0'),
(28, 1, 'Professores da FACFITO e do CMVL participarão da IV Semana de Educação Musical do IA/UNESP', '', '<p>&nbsp;Professores da FACFITO e do Conservat&oacute;rio Musical Villa Lobos (CMVL) estar&atilde;o presentes na IV Semana de Educa&ccedil;&atilde;o Musical - IA/UNESP e o VIII Encontro Regional Sudeste da Associa&ccedil;&atilde;o Brasileira de Educa&ccedil;&atilde;o Musical (ABEM), que ocorrer&atilde;o entre os dias 17 e 21 de setembro, na pr&oacute;pria sede do Instituto de Artes da UNESP, na Barra Funda, em S&atilde;o Paulo. &nbsp;Com uma farta programa&ccedil;&atilde;o, que vai desde palestras e apresenta&ccedil;&otilde;es musicais a minicursos e lan&ccedil;amentos de livros, o evento contar&aacute; com a participa&ccedil;&atilde;o de pesquisadores nacionais e estrangeiros, de educadores musicais e de estudantes de gradua&ccedil;&atilde;o e de p&oacute;s-gradua&ccedil;&atilde;o. &nbsp; Entre os participantes estar&atilde;o as professoras Neide Esperidi&atilde;o, F&aacute;tima Puga e Enny Parejo da FACFITO/CMVL, que ministrar&atilde;o minicursos aos inscritos. &nbsp;Al&eacute;m disso, a FITO marcar&aacute; presen&ccedil;a com outras atividades: dez estudantes da FACFITO ajudar&atilde;o no monitoramento do evento; haver&aacute; o lan&ccedil;amento de um livro sobre Educa&ccedil;&atilde;o de co-autoria de nossas professoras, e ainda haver&aacute; as apresenta&ccedil;&otilde;es da Big Band Villa Lobos e dos corais da FITO/CMVL (ver programa&ccedil;&atilde;o completa pelo endere&ccedil;o eletr&ocirc;nico <a href="https://sites.google.com/site/ivsemanaeducacaomusical/programacao">https://sites.google.com/site/ivsemanaeducacaomusical/programacao</a>).</p>\r\n<div>OBS: Estudantes da FITO poder&atilde;o participar dos cursos e minicursos com descontos especiais.</div>', '2012-09-11', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry''s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.', '', '28_copacabana-night-rio.jpg', '1', '1', 'Professores-da-abge', '', '0', '0');
