('ABGE', '<p><strong>APRESENTA&Ccedil;&Atilde;O:</strong><br />\r\nA Funda&ccedil;&atilde;o Instituto Tecnol&oacute;gico de Osasco &ndash; FITO &eacute; uma funda&ccedil;&atilde;o p&uacute;blica sem fins lucrativos, reconhecida nacionalmente como patrim&ocirc;nio de Osasco desde 1969, quando foi criada.&nbsp; A FITO conta hoje com um corpo docente altamente qualificado, formado por doutores, mestres e especialistas, trabalhando, interdisciplinarmente, na elabora&ccedil;&atilde;o de projetos educacionais para os Ensinos Fundamental, M&eacute;dio, M&eacute;dio T&eacute;cnico e Superior.<br />\r\nAqui s&atilde;o mais de 120.000 metros quadrados de &aacute;rea livre para, al&eacute;m da forma&ccedil;&atilde;o intelectual, promover o desenvolvimento da conviv&ecirc;ncia social e da consci&ecirc;ncia ambiental.<br />\r\n<br />\r\n<strong>MISS&Atilde;O, VIS&Atilde;O E VALORES:</strong><br />\r\nA <strong>MISS&Atilde;O</strong> da FITO &eacute; manter e oferecer o ensino, a pesquisa e o estudo em todos os n&iacute;veis e ramos do saber, bem como promover a divulga&ccedil;&atilde;o cientifica, t&eacute;cnica e cultural &agrave; sociedade. <br />\r\nComo <strong>VIS&Atilde;O</strong> de futuro, a FITO pretende continuar a ser refer&ecirc;ncia em Educa&ccedil;&atilde;o em Osasco e regi&atilde;o, ampliando sempre o potencial de seu pessoal a fim de modernizar suas t&eacute;cnicas de ensino-aprendizagem para o bem comum da sociedade.<br />\r\nPor isso, como institui&ccedil;&atilde;o de ensino, a FITO defende o potencial da cidadania, da honestidade e da fam&iacute;lia, c&eacute;lula primordial da sociedade, enquanto <strong>VALORES</strong> natos para a forma&ccedil;&atilde;o social, pol&iacute;tica e cultural do ser humano, os quais s&atilde;o base de todo processo metodol&oacute;gico adotado pela Funda&ccedil;&atilde;o.</p>', '', '', '', 87, 'pt'),
