INSERT INTO `vision` (`id_vision`, `id_profile`, `tipo`, `titulo`, `contenido`, `archivo`) VALUES
(1, 8, 'vision', '', '<p>&nbsp;<span style="font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: 21px; ">PeriGen solutions support over 15,000 clinicians a year in over 100 North American hospitals. With clinical decision support, fetal monitoring, and professional service solutions specifically developed for Obstetrics, PeriGen is uniquely qualified to assist clinicians in their patient safety and quality care initiatives.&nbsp;</span></p>\r\n<div style="margin: 0px; padding: 0px; border: 0px; font-size: 14px; font-family: Arial, Helvetica, sans-serif; vertical-align: baseline; line-height: 21px; ">But no matter how much we could say to convince you of our abilities, arguably no one can say it better than those we support.</div>', '');
